(3, 2, 'ar', 'ak towers', 'مجمع أك تورز في منطقة أسنيورت', '<p>يقع مشروع Ak Towers في قلب منطقة Esenyurt &nbsp;في اسطنبول</p>\r\n<p>كما يتميز بقربه من جميع الخدمات والمرافق:</p>\r\n<p>يقع بالقرب من المشروع ميدان اسينيورت الشهير حيث يمكنك أن تجد كل ما تحتاجه بسهولة.</p>\r\n<p>يبعد من 7 الى 10 دقائق فقط عن الطريق السريع E5 و E6 و خط المترو بوس و كل من Marmara Park Mall و 5M Migros Beylikd&uuml;z&uuml; و Torium Mall.</p>\r\n<p>و يبعد 20 دقيقة فقط عم مطار اتاتورك الدولي.</p>\r\n<p>يقع بالقرب من المشروع مشفى اسينيورت الحكومي الكبير و مشفى Medical الخاص اضافة لجامعة &nbsp;Esenyurt الحكومية و جامعة Beykent&nbsp; الخاصة .</p>\r\n<p>يحتوي المشروع على ستة أبراج في كل منها 24 طابقاً سكنياً بمجموع 1050 وحدة سكنية بالإضافة الى طابقين هما للمول والخدمات الاجتماعية</p>\r\n<p>&nbsp;</p>\r\n<p>يحتوي المشروع على العديد من الخدمات الخاصة المميزة:</p>\r\n<p>موقف سيارات مغلق من طابقين بمساحة 20.000 متر مربع.</p>\r\n<p>مسبح مغلق بمساحة 100 متر مربع.</p>\r\n<p>مركز تجاري (مول) يتألف من طابقين ويحتوي بالإجمال على 85 محل تجاري كما انه يتوسط المشروع ويحتوي على العديد من الماركات التركية و العالمية.</p>\r\n<p>عدد كبير من المحلات التجارية تحيط بالمشروع اضافة للمول الموجود أصلا مما يجعل منطقة المشروع تنعم بالحيوية والنشاط طوال اليوم.</p>\r\n<p>يحتوي المشروع على صالتين رياضيتين وصالات سينما و سباحة و حضانة اطفال بمساحة 600 متر مربع اضافة للكافيتريات و الاطلالات البانورامية الرائعة.</p>\r\n<p>أسطح الأبراج عبارة عن حدائق و تراسات خضراء خلابة باطلالات ساحرة على المدينة تمنحك شعوراُ بالرفاهية و الرخاء.</p>\r\n<p>&nbsp;</p>\r\n<p>للمزيد من المعلومات، لا تتردد بالتواصل معنا:</p>\r\n<p>00905356865688</p>'),
(5, 3, 'ar', 'INNOVIA 2', 'Esenyurt /İstanbul', '<p>يقع في القسم الأوروبي من مدينة اسطنبول، في منطقة اسنيورت التي تعد من أهم مناطق التطوير العمراني بموقعها الاستراتيجي الذي يبعد عن مطار أتاتورك الدولي مسافة 12 كم وعن منطقة تقسيم 25 كم.</p>\r\n<p>يتألف المجمع من عدد كبير أبنية تضم الاف الشقق السكنية بتصاميم مختلفة، بالإضافة لـعدد كبير من الوحدات التجارية. المجمع قريب من المولات التجارية الشهيرة كـ Marmara Park Mall و 5M Migros Beylikd&uuml;z&uuml; و Torium Mall.</p>\r\n<p>يبعد من 7 الى 10 دقائق فقط عن الطريق السريع E5 و E6 و خط المترو بوس وهو قريب من المدارس والجامعات العربية والتركية، والصيدليات والمراكز الطبية، ومحاط بالمحلات التي تقدم مختلف الاحتياجات اليومية، إضافة للمطاعم التركية والسورية التي تقدم وجبات متنوعة بأسعار معتدلة مع خدمة التوصيل المجاني.</p>\r\n<p>&nbsp;</p>\r\n<p>يتوفر في المجمع شقق سكنية عصرية معروضة للبيع متعددة المساحات لتلبي مختلف المتطلبات والرغبات، وجميع هذه الشقق بمجهزة بحمام أنيق أو اثنين حسب المساحة، مطبخ مجهز بخزائن حديثة، فرن غاز وشفاط هواء.</p>\r\n<p>يتميز هذا المجمع بوسائل الراحة والترفيه التي يقدمها لقاطنيه من مسبح شتوي، مسابح صيفية للكبار وأخرى للصغار، جاكوزي، نادي رياضي يضم مركزا للياقة البدنية، والساونا؛ بالإضافة للملاعب الرياضية المتعددة كالتنس وكرة القدم وكرة السلة، والحدائق المنسقة دائمة الخضرة متنوعة الأزهار. كما يوجد ضمن المجمع كافيتريا، سوبر ماركت، كوافير نسائي ورجالي، محل لتنظيف الملابس، مستوصف، قاعة حفلات واجتماعات.</p>\r\n<p>يقوم على راحة سكان المجمع فريق متكامل من العاملين المدربين لتأمين الصيانة والنظافة العامة والعناية بالحدائق، إضافة لحراسة المجمع وحمايته على مدار الساعة. هذا بالإضافة لكاميرات المراقبة المنتشرة في ممرات المجمع، الحدائق، الطوابق وكراج المجمع المؤلف من 3 طوابق في كل بناء.</p>\r\n<p>&nbsp;</p>\r\n<p>للمزيد من المعلومات، لا تتردد بالتواصل معنا:</p>\r\n<p>&nbsp;</p>\r\n<p>00905356865688</p>'),
(6, 4, 'ar', 'monreve EYÜP', 'Bayrampaşa/İstanbul', '<p>للمزيد من المعلومات، لا تتردد بالتواصل معنا:</p>\r\n<p>&nbsp;</p>\r\n<p>00905356865688</p>'),
(7, 5, 'ar', 'Birlik Parkada', 'Bayrampaşa /Istanbul', '<p><strong>تقع منطقة \"أيوب\" (Ey&uuml;p) في قلب مدينة إسطنبول، وتمتد من القرن الذهبي وصولا إلى شاطئ البحر الأسود. وتبلغ مساحتها 223.78 كم مربع و تعدادها السكاني 345,790 نسمة.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>من مميزات هذا المشروع:</strong></p>\r\n<p><strong>- شقق سكنية فاخرة ومحلات تجارية مميزة في أرقى مناطق إسطنبول.</strong></p>\r\n<p><strong>- يمتد على مساحة تقدر ب 11000 متر مربع.</strong></p>\r\n<p><strong>- ميزات أمان خاص عالي المستوى، تلفزيون الدائرة المغلقة، الفيديو doorphone.</strong></p>\r\n<p><strong>- مواصفات فنية ببنية تحتية رقمية (كابل الألياف البصرية)، وعدد 6 مصاعد يؤمن سهولة التنقل وخزان ماء وغيرها من الميزات الفنية الأخرى.</strong></p>\r\n<p><strong>- ميزات داخلية: المطبخ الأمريكي، حمام الوالدين.</strong></p>\r\n<p><strong>- ميزات إجتماعية مثل حديقة ومقهى وملعب للأطفال وبواب..الخ.</strong></p>\r\n<p><strong>- منشآت رياضية فريدة مثل صالة رياضية مجهزة تجهيزا كاملا، وملعب لكرة القدم والسلة، وحمام سباحة داخلي وخارجي، وساونا.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(8, 6, 'ar', 'Mamik Life', 'Yeşilyurt / Başiskele / Kocaeli Hotels', '<p>يلفت مشروع ماميك لايف المتصاعد في&nbsp;<a title=\"مشاريع الإسكان Başiskele ، مشاريع Başiskele\" href=\"https://www.guncelprojebilgileri.com/basiskele-konut-projeleri\">باشيسكيل</a>، إحدى&nbsp;المناطق النامية في مقاطعة&nbsp;<a title=\"Kocaeli Konut Projeleri, Kocaeli Projeleri\" href=\"https://www.guncelprojebilgileri.com/kocaeli-konut-projeleri\">كوجالي</a>،&nbsp;الانتباه إلى هندسته المعمارية المختلفة.&nbsp;بالإضافة إلى الشقق، هناك 13 وحدة تجارية في المشروع، والتي تشمل أيضا فيلات منفصلة.</p>\r\n<p>المشروع&nbsp;بالقرب من كلية طب الأسنان بجامعة&nbsp;<a title=\"مشاريع كوجيلي السكنية ، مشاريع كوجيلي\" href=\"https://www.guncelprojebilgileri.com/kocaeli-konut-projeleri\">كوكالي</a>.&nbsp;يقع في منطقة (يوفاجيك) القلب الأخضر لمحافظة كوجالي المنطقة الجميلة بهوائها الطلق الصافي، وقد تم الإنتهاء من تنفيذ المشروع وبدأ السكن فيه.</p>\r\n<p>&nbsp;</p>\r\n<p>من مميزات هذا المشروع:</p>\r\n<p>- يتميز المشروع على بإطلالته الجميلة على خليج مرمرة و على سلسلة جبال كارتبه المميزة (تلة الثلج).</p>\r\n<p>- يتموضع مشروع ماميك لايف بعيدا عن الإزدحام والضوضاء ليكون بعده عن مركز مدينة إزميت ما يقارب 8 كم، ويبعد عن مركز التسوق 5 كم، وبعيدا 7 كم عن مول سيمبول.</p>\r\n<p>- يحوي المشروع مسبح مفتوح، مسبح مغلق، مركز رياضي، حمام ساونا، حمام بخار، حمام تركي، ألعاب للأطفال مطعم و كافيه ومواقف سيارات مغلقة.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(9, 7, 'ar', 'Orka Life', 'العنوان: Yeşilyurt Mahallesi Başiskele/Kocaeli', '<p>مشروع مشترك وإستثماري لشركات Kavan Construction، Mamik Group) Seval Construction)، يقع في منطقة \"كوجالي\" حيث تتقاطع السكك الحديدية التي تربط بين قارتي آسيا وأوروبا بإسطنبول. وتعتبر المدينة من أهم المراكز الصناعية بمنطقة \"مرمرة\" وعموم تركيا، كما تتميز المدينة بالقرى الجميلة والطبيعة الخلابة، بجانب التاريخ الذي يجدد نفسه دائماً.</p>\r\n<p>&nbsp;</p>\r\n<p>من مميزات هذا المشروع:</p>\r\n<p>- يمتد المشروع على مساحة 26000 متر مربع بعدد شقق يبلغ 138 شقة، مع ميزة أمن خاص، والعديد من المميزات الفنية مثل خزان الماء..الخ.</p>\r\n<p>- يحوي المشروع حديقة نموذجية وملعب للأطفال ومقهى.</p>\r\n<p>- مجموعة من الميزات الداخلية مثل العزل الحراري وعزل الصوت وموقد.</p>\r\n<p>- العديد من المنشآت الرياضية الأنيقة مثل ملعب لكرة القدم والسلة، وملعب تنس، وحمام سباحة داخلي وخارجي، بالإضافة إلى حمام سباحة للأطفال.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(10, 8, 'ar', 'West Wall Marina Villaları', 'Beylikdüzü / İstanbul ', '<p><strong>أحدث مشروع مارينا في إسطنبول!&nbsp;إختر الفيلا التي تناسبك ، وإبدأ استكشاف <span class=\"yellow\">أرض العجائب إسطنبول من البحر</span>.</strong></p>\r\n<p><strong>لديك العديد من الخيارات لإستكشاف إسطنبول من البحر، الأزرق والأخضر والفخامة والإمتياز والسلام والراحة ... مرحبًا بكم في منطقتنا الخاصة التي تضم 64 قصرًا يقع في&nbsp;<span class=\"yellow\">ويست وول مارينا فيلاز.</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p>من مميزات هذا المشروع:</p>\r\n<p>- يتكون المشروع من 64 منطقة مستقلة مبنية على 62 فدانا.</p>\r\n<p>- يشمل مشروعنا ملعبًا للتنس وملعبًا لكرة السلة ومسبحًا مشتركًا في الهواء الطلق وملاعب للأطفال.</p>\r\n<p>- إذا كنت ترغب في ذلك، يمكن لك تحويل مكان من الحديقة الكبيرة كمسبح مستقل.</p>\r\n<p>- يوجد مجموعة واسعة من الخيارات بدءا من 353 متر مربع كحد أدنى إلى 815 متر مربع كحد أقصى.</p>\r\n<p>- المشروع تحت الحراسة 24 ساعة من قبل شركة أمن خاصة.</p>\r\n<p>- مناسب للتقديم على الجنسية التركية.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(11, 9, 'ar', 'Phantom İstanbul', 'İstanbul / Esenyurt', '<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(12, 10, 'ar', 'Önay Life Residence', 'esenyurt istanbul', '<p>مشروع أوناي لايف ريزيدانس تم إنشاؤه من قبل شركة أوناي المساهمة.,يقع في مدينة إسطنبول الجانب الأوروبي في حي أسنيورت.</p>\r\n<p>,وهو عبارة عن برج سكني بنظام الخدمة الفندقية، ويحيط بالمشروع جميع الخدمات والأسواق.</p>\r\n<p>تم بناء المشروع على أرض مساحتها 7000م2، منها 3500م2 خصصت لمساحة البناء، والمساحة المتبقية خصصت للمساحات الخضراء والمحلات التجارية، بالإضافة إلى ملاعب الأطفال، ومواقف السيارات الخارجية.</p>\r\n<p>&nbsp;</p>\r\n<p>من مميزات هذا المشروع:</p>\r\n<p>- نظام المنزل الذكي&nbsp;</p>\r\n<p>- إستعلامات&nbsp;</p>\r\n<p>- أمن على مدار 24 ساعة&nbsp;</p>\r\n<p>- نظام انذار الطوارئ العاجل&nbsp;</p>\r\n<p>- نظام البصمة وبطاقة المرور&nbsp;</p>\r\n<p>- مواقف سيارات مغلقة ومفتوحة&nbsp;</p>\r\n<p>وغيرها من الخدمات المخصصة لراحة السكان ورفاهيتهم.</p>\r\n<p>&nbsp;</p>\r\n<p>حجم المشروع:</p>\r\n<p>- مجموع الشقق في المشروع 432 شقة تتضمن المنازل المكتبية أيضا.</p>\r\n<p>- يتكون المشروع من 25 طابق بالإضافة إلى 3 طوابق سفلية لمواقف السيارات.</p>\r\n<p>- جميع أنواع الشقق تحتوي على بلكونة خاصة بالشقة.</p>\r\n<p>- أنواع الشقق هي 1+1 / 2+1 / 3+1&nbsp;</p>\r\n<p>- عدد المحلات التجارية الموجودة في المجمع هو 17 محل تجاري حيث تتضمن جميع الخدمات.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(13, 11, 'ar', 'avcilar garden', 'Avcılar / Istanbul', '<p>تم بناء مشروع أفجلار جاردن على قطعة أرض مساحتها 10 آلاف متر مربع، والذي يتألف من 4 بنايات تحتوي على مجموع 182 شقة سكنية جاهزة للتملك في إسطنبول. لم تصمم البنايات لتكون طويلة وذات طوابق كثيرة. يحتوي المشروع على نوعين من الشقق، شقق 2+1 تتراوح مساحتها بين 121 إلى 132 مترمربع و شقق 3+1 ذات مساحة 159 مترمربع.</p>\r\n<p>&nbsp;</p>\r\n<p>من مميزات هذا المشروع:</p>\r\n<p>- المشروع قريب نسبياً من طريق E5 الرئيسي و مطار أتاتورك و خط المتروبوس يتميز المشروع بإطلالات بحرية من الشقق بالإضافة لكونه لا يحتوي على شقق غرفة و صالة الذي يجعله مجمع عائلي بإمتياز.</p>\r\n<p>- يتواجد المشروع بمنطقة مخدمة و بالقرب من خطوط المواصلات العامة.</p>\r\n<p>- بالقرب من المشروع ساحل أفجلار و بحر مرمرة و حدائق عامة جامعات و مدارس خاصة مراكز تجارية مستشفيات حكومية وخاصة.</p>\r\n<p>&nbsp;</p>\r\n<p>اسم المقاول: Bayburtlu İnşaat&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(14, 12, 'ar', 'Olimpa PARK - أولمبا بارك', 'İstanbul / Başakşehir', '<p><strong>&nbsp;</strong><strong>نوع العقار: </strong>مجمع سكني</p>\r\n<p><strong>الموقع: </strong>الدولة: تركيا، المدينة: إسطنبول، الحي: باشاك شهير</p>\r\n<p>&nbsp;</p>\r\n<p><strong>لمحة عن العقار:</strong></p>\r\n<p>- مشروع مميز جاهز للسكن والتسليم المباشر، وهو عبارة عن برجين بارتفاع 16 طابق، 126 شقة سكنية، يقع في منطقة باشاك شهير، وقد اكدت دراسات معهد الإحصاء التركي ان أسعار العقارات ارتفعت 33٪ في منطقة باشاك شهير عام 2015، وهذا ما يجعل موقع مشروعنا المتميز في اهم مكان لأكبر فرصة استثمارية.</p>\r\n<p>- المجمع عائلي يحقق شروط الامان والاناقة والرفاهية والراحة، كما يحتوي على مسابح وحمام تركي وغرفه بخار وساونا وصالات رياضيه وكافتيريات ومساجد، وكما يتربع المجمع بجوار أكبر مدينة طبية في اوروبا مع إطلالات رائعة على وادي باشاك شهير، كما ان المشروع قريب من الطريق الواصل الى جسر اسطنبول الثالث، وإلى المطار الثالث الأكبر في العالم.</p>\r\n<p><strong>&nbsp;- </strong>على بعد أمتار من المجمع يوجد مركز تجاري بمساحة 26.000 م2 يلبي جميع احتياجاتكم الشرائية، وتقضون أمتع الاوقات في 86 من محل تجاري و20 كافتيريا و18 مطعم، وتستمتعون بمشاهده أطفالكم في ملاعبهم الخاصة.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>&nbsp;</strong><strong>مزايا الموقع:</strong></p>\r\n<p>- يبعد 15 دقيقة عن مطار اتاتورك.</p>\r\n<p>- يبعد 20 كم عن المطار الثالث أكبر مطار في العالم.</p>\r\n<p>- يبعد المشروع 100 م عن محطة المترو قيد الإنشاء.</p>\r\n<p>- يبعد المشروع 400 م عن محطة باشاك كونوكلاري و600 م عن محطة مترو كنت.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ميزات العقار:</strong></p>\r\n<p>- حمام تركي &amp; SPA</p>\r\n<p>- نظام أمنى متكامل 24/7</p>\r\n<p>- مواقف سيارات مغلقة ومفتوحة</p>\r\n<p>- حديقة اطفال وملاعب رياضية</p>\r\n<p>- مسبح مغلق</p>\r\n<p>- مطاعم ومقاهي داخل المجمع السكني</p>\r\n<p>- مستودع بمساحة 5 م2 خاص لكل شقة</p>\r\n<p>&nbsp;</p>\r\n<p><strong>أنماط الشقق:</strong></p>\r\n<p><strong>- </strong><strong>3 غرف نوم وصالون: </strong>بمساحات 134-138-135 متر مربع&nbsp; (مطبخ منفصل، وحمامان، وحمام خاص في غرفة النوم الرئيسية،&nbsp; شرفة بإطلاله رائعة مع مستودع خاص بك مساحته 5 متر مربع).</p>\r\n<p><strong>- 4 غرف نوم وصالون: </strong>بمساحات 196-195 متر مربع (مطبخ منفصل، وحمامان، وحمام خاص في غرفة النوم الرئيسية، شرفة بإطلاله رائعة مع مستودع خاص بك مساحته 5 متر مربع).</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>مساحة المشروع: 8000 متر مربع</p>\r\n<p>&nbsp;</p>\r\n<p>المساحة الخضراء: 60% من مساحة المشروع</p>\r\n<p>&nbsp;</p>\r\n<p><strong>لماذا منطقة باشاك شهير وأبرز ما يميز الموقع:</strong></p>\r\n<h4>- حداثة المنطقة: تعتبر منطقة باشاك شهير من احدث المناطق في تركيا حيث تجتمع البنى التحتية العصرية مع الهندسة والتخطيط العصريين.</h4>\r\n<p><strong>- قبلة للمستثمرين وأصحاب الأعمال: حداثة المنطقة وتنوع معالمها ومشاريعها جعلها قبلة للمستثمرين واصحاب الأعمال ما دعا الحكومة التركية إلى الاهتمام بها على وجه خاص فأصبحت تمتلك أعلى معايير الرفاهية والراحة حيث تتوفر الابنية المتينة المضادة للزلازل والمرافق الاجتماعية المتنوعة والكثيرة ومنها ما هو الافضل على مستوى اوروبا.</strong></p>\r\n<p><strong>- المواصلات: تتوفر في منطقة باشاك شهير العديد من محطات الباصات و محطات المترو ويتم انشاء عدة محطات مترو وترام واي جديدة.</strong></p>\r\n<p><strong>- أشهر معالم المنطقة: اكبر حديقة نباتية في اوروبا اكبر مدينة طبية في الشرق الأوسط اكبر ميدان في تركيا تبعد عن اكبر مطار في العالم (مطار اسطنبول الجديد) عدة كيلومترات تبعد عن مطار اتاتورك عدة كيلومترات وادي باشاك شهير.</strong></p>\r\n<p><strong>- المدارس والجامعات: تحتوي المنطقة على العديد من المدارس العربية والدولية بمختلف المراحل التعليمية بالإضافة للعديد من الجامعات.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(15, 13, 'ar', 'Babacan Premium', 'Esenyurt / Haramidere ', '<p><strong>مشروع مميز في تركيا مكون من شقق سكنية &ndash; شقق فندقية - تجارية &ndash; مركز تسوق، على مساحة 15000 م2</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>ميزات الموقع:</strong></p>\r\n<p>- إسطنبول - إسنيورت هراميدره Esenyurt / Haramidere</p>\r\n<p>- يبعد 250م عن خط المتروبوس</p>\r\n<p>- يحيط بالموقع العديد من المرافق الحيوية والخدمية (مول مرمرة بارك، كارفور، توريوم مول، ميغروبس)</p>\r\n<p>- يبعد 20 دقيقة عن مطار أتاتورك</p>\r\n<p>- يبعد 35 دقيقة عن مركز إسطنبول</p>\r\n<p>- يبعد 10 دقائق عن مدينة المعارض</p>\r\n<p>&nbsp;</p>\r\n<p><strong>مواصفات المشروع:</strong></p>\r\n<p>- عدد الكتل: 6</p>\r\n<p>- لا مساحة أرض المشروع: 15000 م2</p>\r\n<p>- مكون من شقق سكنية &ndash; شقق فندقية - تجارية &ndash; مركز تسوق.</p>\r\n<p>- تاريخ التسليم: 06/2018</p>\r\n<p>&nbsp;</p>\r\n<p>ميزات المشروع:</p>\r\n<p>- تشطيب ديلوكس</p>\r\n<p>- يتوفر شقق مع بلكون وتراسات</p>\r\n<p>- شقق فندقية يديرها المجمع لكم.</p>\r\n<p>- حدائق واسعة وبحيرات اصطناعية</p>\r\n<p>- أماكن مخصصة للمشي والركض</p>\r\n<p>- العاب اطفال</p>\r\n<p>- نادي رياضي gym</p>\r\n<p>- مسبح مفتوح</p>\r\n<p>- حمام تركي &ndash; غرفة ساونا وبخار</p>\r\n<p>- سينما خارجية Outdoor Cinema</p>\r\n<p>- ملاعب تنس وكرة سلة وسكواتش</p>\r\n<p>- حراسة 24 ساعة</p>\r\n<p>- أماكن مخصصة للشواء</p>\r\n<p>- كراج سيارات مغلق ومفتوح</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(16, 14, 'ar', 'AKKOZA AKBATI', 'منطقة بهشة شاهير - İstanbul Bahçeşehir ', '<p>مجمع اكوزا ( Akkoza ) يقع في منطقة بهشا شهير التابعة لحي باشاك شهير الهادئ والحيوي في اسطنبول</p>\r\n<p>في داخل المجمع يوجد مول اكباتي ويحيط بالمجمع أسواق تضم كافة أنواع المحلات التجارية والخدمية&nbsp;</p>\r\n<p>يبعد عن مطار اتاتورك حوالي 20 دقيقة</p>\r\n<p>يبعد عن مركز المدينة 40 دقيقة</p>\r\n<p>الميزة الأهم للمجمع هو إمكانية الإستثمار في الإيجار اليومي</p>\r\n<p>حيث يوجد هناك طلب كبير في الموسم السياحي على هذا المجمع من قبل الأخوة الخليجين&nbsp;</p>\r\n<p>&nbsp;</p>'),
(17, 15, 'ar', 'EVİM YUKSEKDAĞ', 'İstanbul Esenyurt', '<p>EVİM YUKSEKDAĞ</p>\r\n<p>مشروع متكامل</p>\r\n<p>يوفر لكم ايفيم يوكسك داغ حياة هادئة مع شققها المرموقة والمساحات الخضراء ذات المناظر الطبيعية والمرافق&nbsp;الاجتماعية والرياضية مصممة حسب مايروق للعائلة</p>\r\n<p>&nbsp;</p>\r\n<p><strong>موقع المشروع:</strong><br /><br />يقع المشروع في الطرف الأوروبي من ولاية اسطنبول وتحديدا في منطقة أسنيورت والتي تعتبر من أهم ضواحي مدينة اسطنبول التي ارتفعت فيها الكثافة السكانية بشكل كبير خلال السنوات العشر الأخيرة والتي تقع شمال بحر مرمرة , جنوب منطقة اسنيورت , شرق منطقة بيوك تشكمجة وغرب منطقة افجلار.<br /><br /><br />موقع المشروع محاط بخدمات متكاملة من مراكز تسوق / جامعات / مدارس حكومية و خاصة / مشافي.</p>\r\n<p>&nbsp;</p>\r\n<p>يبعد 1.7 كم عن محطة المتروباص *<strong>أهم وسيلة مواصلات في اسطنبول</strong>*</p>\r\n<p>هناك العديد من المواصلات العامة التي تسهل عملية النقل باتجاه مركز المدينة</p>\r\n<p>&nbsp;</p>\r\n<p>*محطة الميترو ستكون على بعد 700 م عن المشروع في عام 2019</p>\r\n<p>&nbsp;</p>\r\n<p><strong>تفاصيل المشروع:</strong></p>\r\n<p>&nbsp;</p>\r\n<p>7000 متر مربع مساحات خضراء وممرات مائية</p>\r\n<p>2000 متر مربع مركز تجاري يلبي احتياجات السكان</p>\r\n<p>المجمع مؤلف من ثلاث مباني (363 وحدة سكنية) بنمط غرفتين وصالة وثلاث غرف وصالة</p>\r\n<p>وتتميز الوحدات السكنية بالمشروع بتصاميمها العصرية واطلالاتها المفتوحة على المساحات الخضراء (يوجد في كل شقة شرفات واسعة&nbsp; ومطابخ منفصلة وحمامين)</p>\r\n<p>بالإضافة لشقق واسعة مع حدائق.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>طرق الدفع:</strong></p>\r\n<p>40 % دفعة اولى واقساط على 36 شهر</p>\r\n<p>50% دفعة اولى واقساط على 24 شهر</p>\r\n<p>حسم 8% على الدفع النقدي</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(18, 16, 'ar', 'ALMINA TOWER', 'اسطنبول الأوروبية - حي أسنيورت', '<p><strong>مجمع المينا&nbsp;</strong></p>\r\n<p>يقع المجمع في منطقة اسنيورت في القسم الأوروبي بمدينة اسطنبول، والتي تلاقي&nbsp; رواجا وشهرة كبيرة بسبب المجمعات السكنية والمشاريع والعقارات التي تحوي على شقق سكنية بأسعار معقولة مقارنة مع المناطق الأخرى من اسطنبول.</p>\r\n<h4>&nbsp;</h4>\r\n<h4><strong>مزايا المشروع :</strong></h4>\r\n<p><span class=\"fontstyle0\">یعتبر ھذا المشروع مثالیا بسبب موقعھ الذي من المتوقع أن یمنح المستثمرین عائد استثماري عالي في السنوات القلیلة القادمة.</span></p>\r\n<p><span class=\"fontstyle0\">يتألف من برج واحد يحتوي على شقق سكنية فاخرة مؤلف من 31 طابق.</span></p>\r\n<p><span class=\"fontstyle0\">تصمیم معماري رائع وتشطیب عالي الجودة.</span></p>\r\n<p><span class=\"fontstyle0\">توجد إطلالات بحریة.</span></p>\r\n<p>مرافق اجتماعية متنوعة لراحتكم وسعادتكم.</p>\r\n<p>بالقرب من العديد من المراكز التجارية الشهيرة.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>خصائص الموقع:</strong></p>\r\n<ul>\r\n<li>يبعد عن الطريق الرئيسي E5 خمس دقائق</li>\r\n<li>يبعد عن الطريق الرئيسي E6 عشرة دقائق</li>\r\n<li>يبعد عن مطار أتاتورك 20 دقيقة&nbsp;</li>\r\n<li>يبعد عن المطار الثالث 25 دقيقة</li>\r\n<li>يبعد عن الطريق الرئيسي الواصل بين E6 و E5 دقيقتين</li>\r\n<li>يبعد عن&nbsp;ميدان التقسيم واكسراي والفاتح 30 دقيقة</li>\r\n<li>يبعد عن محطة المتربوس 5 دقائق</li>\r\n<li>محطة المترو الذي سوف يتم انشائها في عام 2019 : 5 دقائق</li>\r\n<li>يبعد عن&nbsp; مدينة المعارض TUYAP&nbsp;&nbsp;ثلاثة عشر دقيقة</li>\r\n<li>جامعة اسطنبول : 10 دقائق</li>\r\n<li>جامعة بيكنت : 10 دقائق</li>\r\n<li>جامعة اسانيورت : 3 دقائق</li>\r\n<li>مول مرمرة بارك : 5 دقائق</li>\r\n<li>مول اكباتي : 5 دقائق</li>\r\n<li>مول توريم : 4 دقائق</li>\r\n<li>مستشفى ميديكال : 4 دقائق</li>\r\n<li>مستشفى ميديكانا : 5 دقائق</li>\r\n<li>مستشفى اسانيورت : 5 دقائق</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(19, 17, 'ar', 'ak towers', 'مشروع الأبراج البيضاء في أسنيورت', '<p>يقع مشروع Ak Towers في قلب منطقة Esenyurt &nbsp;في اسطنبول، ويتميز بقربه من جميع الخدمات والمرافق:</p>\r\n<p>يقع بالقرب من المشروع ميدان اسينيورت الشهير حيث يمكنك أن تجد كل ما تحتاجه بسهولة.</p>\r\n<p>يبعد من 7 الى 10 دقائق فقط عن الطريق السريع E5 و E6 و خط المترو بوس و كل من Marmara Park Mall و 5M Migros Beylikd&uuml;z&uuml; و Torium Mall.</p>\r\n<p>و يبعد 20 دقيقة فقط عم مطار اتاتورك الدولي.</p>\r\n<p>يقع بالقرب من المشروع مشفى اسينيورت الحكومي الكبير و مشفى Medical الخاص اضافة لجامعة &nbsp;Esenyurt الحكومية و جامعة Beykent&nbsp; الخاصة .</p>\r\n<p>يحتوي المشروع على ستة أبراج في كل منها 24 طابقاً سكنياً بمجموع 1050 وحدة سكنية بالإضافة الى طابقين هما للمول والخدمات الاجتماعية</p>\r\n<p>&nbsp;</p>\r\n<p>يحتوي المشروع على العديد من الخدمات الخاصة المميزة:</p>\r\n<p>موقف سيارات مغلق من طابقين بمساحة 20.000 متر مربع.</p>\r\n<p>مسبح مغلق بمساحة 100 متر مربع.</p>\r\n<p>مركز تجاري (مول) يتألف من طابقين ويحتوي بالإجمال على 85 محل تجاري كما انه يتوسط المشروع ويحتوي على العديد من الماركات التركية و العالمية.</p>\r\n<p>عدد كبير من المحلات التجارية تحيط بالمشروع اضافة للمول الموجود أصلا مما يجعل منطقة المشروع تنعم بالحيوية والنشاط طوال اليوم.</p>\r\n<p>يحتوي المشروع على صالتين رياضيتين وصالات سينما و سباحة و حضانة اطفال بمساحة 600 متر مربع اضافة للكافيتريات و الاطلالات البانورامية الرائعة.</p>\r\n<p>أسطح الأبراج عبارة عن حدائق و تراسات خضراء خلابة باطلالات ساحرة على المدينة تمنحك شعوراُ بالرفاهية و الرخاء.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(20, 18, 'ar', 'مشروع G HUB الطلابي', 'Küçükçekmece /İstanbul', '<p>المشروع تم تصميمه ليكون أحد أفضل الأمثلة على المشاريع الطلابية، حيث من المخطط أن يكون كسكن للطلاب ويتميز بقربه من الجامعات الحكومية والخاصة</p>\r\n<p>يتكون المشروع من 3 وحدات سكنية على مساحة 17000م2، بمجموع 510 وحدة سكنية.</p>\r\n<p>يتمتع موقع المشروع بسهولة الوصول إلى أغلب الأماكن الحيوية:</p>\r\n<ul>\r\n<li>مطار أتاتورك الدولي 10 د.</li>\r\n<li>مطار إسطنبول الجديد 20 د.</li>\r\n<li>منطقة تقسيم 20 د.</li>\r\n<li>ساحل بحيرة كوشوك شكمجة 4 د.</li>\r\n<li>قريب جدا من خط الـ E5.</li>\r\n<li>يبعد عن خط TEM 7 د.</li>\r\n</ul>\r\n<p>المشروع قد التنفيذ ومن المتوقع أن ينتهي بنهاية عام 2021م، ويقع في منطقة كوشوك شكمجة المنطقة القريبة من البحر</p>\r\n<p>&nbsp;</p>\r\n<p>نظام البيع في المشروع كالتالي:&nbsp;</p>\r\n<p>كل غرفة في المشروع سيتم تسجيلها بسند ملكية منفصل وسيتم تسليمها مجهزة ليستخدمها الطالب مباشرة.</p>\r\n<p>كل 3 غرف في المشروع تشترك بصالة واحدة، وبإمكانك الإستثمار بشراء غرفة واحدة فقط، أو بشراء شقة كاملة.</p>\r\n<p>تضمن إدارة المشروع تشغيل المشروع بعائد إيجار سنوي: 20,000 للغرفة الواحدة لمدة 3 سنوات و60,000 ليرة تركية للشقة الواحدة.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(21, 19, 'ar', 'مشروع G ROTANA الفندقي', 'Bağcılar / İstanbul', '<p>مشروع جي روتانا - G Rotana</p>\r\n<p>هو فندق وشقق فندقية (عدد الشقق الفندقية 153 شقة)</p>\r\n<p>المشروع استثماري بحت بحيث يمكن للمالك ان يستثمر الشقة بعقد مع شركة روتانا بحيث يتم تأجير الشقة من المالك إلى شركة روتانا ويحق للمالك الاستفادة من الشقة مدة 15 يوم في السنة</p>\r\n<p>أو يتصرف بالشقة حسب ما يشاء (سكن - تأجير خاص)</p>\r\n<p>المجمع مقسم إلى ثلاثة أقسام من الطابق 1 الى الطابق 14 هو الفندق</p>\r\n<p>من الطابق 14 الى الطابق 16 خدمات فندقية</p>\r\n<p>من الطابق 16 فما فوق شقق فندقية بخدمات فندقية تامة</p>\r\n<p>الشقق المتوفر: 2+1 بمساحات (155 - 120) 1+1 بمساحات (76 - 78)</p>\r\n<p>التكييف مركزي تأتي الشقة بالفرش والتجهيز الكامل: تلفزيونات - مواد مطبخ - اجهزة مطبخ (براد - مايكروويف - ساحب هواء - فرن - غاز - غسالة صحون - فريزة)</p>\r\n<p>&nbsp;</p>\r\n<p>تضمن إدارة الفندق عائد سنوي لمدة 3 سنوات، بعد الانتهاء من ضمان الثلاث سنوات يحول الايراد الى pool system حيث توزع ايرادات الفندق على المالكين بحسب الامتار التي يملكونها:</p>\r\n<p>&nbsp;</p>\r\n<p>العائد السنوي كالتالي:</p>\r\n<p>&nbsp;</p>\r\n<p>انماط الشقق:</p>\r\n<p>&nbsp;</p>\r\n<p>1+1 76-78 m2:</p>\r\n<p>العائد السنوي المضمون : 20.000$</p>\r\n<p>&nbsp;</p>\r\n<p>2+1 120 m2:</p>\r\n<p>العائد السنوي المضمون: 30.000$</p>\r\n<p>&nbsp;</p>\r\n<p>2+1 155 m2:</p>\r\n<p>العائد السنوي المضمون: 40.000$</p>\r\n<p>&nbsp;</p>\r\n<p>التملك في روتانا يمنحك حق الحصول على الجنسية التركية لأنه مقيم من قبل الحكومة التركية ولأن سند الملكية جاهز</p>\r\n<p>ملاحظة:&nbsp;السعر يتضمن المفروشات.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(22, 20, 'ar', 'Avrupa Konutları', 'Başakşehir / İstanbul', '<p>تمت إقامة مشروع Avrupa Konutları في مركز الجذب الجديد بإسطنبول في حي Başakşehir بجانب الطرق المؤدية إلى جسر يافوز سلطان سليم والمطار الثالث.</p>\r\n<p>يتكون مشروع Avrupa Konutları Başakşehir من ثلاث قطع أراضي على مساحة 72,706 متر مربع بالإضافة إلى مساحة بناء تبلغ 244,325 متر مربع.</p>\r\n<p>المشروع من 11 مجمعًا سكنيًا يشمل 941 شقة و27 وحدة تجارية لتلبية الاحتياجات التجارية الأساسية، وتم بناء هذه المباني على أحدث طراز معماري.</p>\r\n<p>جميع الشقق في هذا المشروع كبيرة وواسعة، حيث إن خيارات الشقق 2+1، و3+1، و4+1، و5+1 تم بناؤها على مساحة تبدأ من 124، و162، و200، و277 على التوالي.</p>\r\n<p>يخصص مشروع Avrupa Konutları Başakşehir مساحة هائلة للمناظر الطبيعية الخضراء والزرقاء بتصميم حدائق مائية مزينة على إجمالي مساحة 4,500 متر مربع.</p>\r\n<p>يوجد مرفقان اجتماعيان يحتويان على حمامين للسباحة تم تصميمهما بشكل منفصل للرجال والنساء بالإضافة لحمام سباحة للأطفال، وغرفة لتمارين اللياقة البدنية، وحمام تركي، وساونا، وغرفة بخار، كل هذا يجعل الرياضة جزءًا أساسيًا من حياتك اليومية.</p>\r\n<p>هناك نمط حياة صحي ينتظرك في الحديقة المجاورة للمشروع المزودة بملاعب كرة القدم، وكرة السلة، والكرة الطائرة، بالإضافة لقاعات التنس، وممرات سير، ومناطق ترفيهية.</p>\r\n<p>يقع مشروع Avrupa Konutları Başakşehir على مسافة قريبة من مدارس المنطقة، كما يقع بالقرب من مركز Health Town الذي يشمل تسع مستشفيات متخصصة، وكذلك بالقرب من الميدان العام والحديقة العامة.</p>\r\n<p>&nbsp;</p>\r\n<p>ملاحظة: المشروع تابع لشركة Emlak Konut العلامة التجارية الراسخة في قطاع الصناعات الإنشائية.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>لماذا منطقة باشاك شهير وأبرز ما يميز الموقع:</strong></p>\r\n<h4>- حداثة المنطقة: تعتبر منطقة باشاك شهير من احدث المناطق في تركيا حيث تجتمع البنى التحتية العصرية مع الهندسة والتخطيط العصريين.</h4>\r\n<p><strong>- قبلة للمستثمرين وأصحاب الأعمال: حداثة المنطقة وتنوع معالمها ومشاريعها جعلها قبلة للمستثمرين واصحاب الأعمال ما دعا الحكومة التركية إلى الاهتمام بها على وجه خاص فأصبحت تمتلك أعلى معايير الرفاهية والراحة حيث تتوفر الابنية المتينة المضادة للزلازل والمرافق الاجتماعية المتنوعة والكثيرة ومنها ما هو الافضل على مستوى اوروبا.</strong></p>\r\n<p><strong>- المواصلات: تتوفر في منطقة باشاك شهير العديد من محطات الباصات و محطات المترو ويتم انشاء عدة محطات مترو وترام واي جديدة.</strong></p>\r\n<p><strong>- أشهر معالم المنطقة: اكبر حديقة نباتية في اوروبا اكبر مدينة طبية في الشرق الأوسط اكبر ميدان في تركيا تبعد عن اكبر مطار في العالم (مطار اسطنبول الجديد) عدة كيلومترات تبعد عن مطار اتاتورك عدة كيلومترات وادي باشاك شهير.</strong></p>\r\n<p><strong>- المدارس والجامعات: تحتوي المنطقة على العديد من المدارس العربية والدولية بمختلف المراحل التعليمية بالإضافة للعديد من الجامعات.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(23, 21, 'ar', 'NIDA PARK BOMONTI', 'Bomonti Sisli  Istanbul', '<p>يقع مشروع NIDA PARK BOMONTI في منطقة بومونتي في حي شيشلي الواقع في إسطنبول الأوروبية.</p>\r\n<p>يتكون مشروع NIDA PARK BOMONTI من برج واحد يطل على مضيق البوسفور، ويحتوي على أنماط شقق من 1+1 إلى 4.5+1، وكما يحتوي المشروع على العديد من المرافق المختلفة مع توفر كل مقومات البنية التحتية لتوفير أقصى درجات الراحة.</p>\r\n<p>&nbsp;</p>\r\n<p class=\"mb-1\" dir=\"rtl\"><strong>يتكون المشروع من 5 أقسام:</strong></p>\r\n<div id=\"about-more\">\r\n<p dir=\"rtl\">Nidapark Bomonti Terrace, Nidakule Bomonti Office, Nidapark Bomonti Tower, Nidapark Bomonti Square and Nidapark Bomonti Suit.</p>\r\n<p dir=\"rtl\">&nbsp;</p>\r\n</div>\r\n<p>يعتبر حي شيشلي مركز إسطنبول التجاري والسياحي فهو معروف بشارع الإستقلال الواقع في منطقة تقسيم الشهيرة، وكما&nbsp;يتوفر بالقرب من المشروع جميع أنواع المواصلات: حيث يتوفر المترو، وخط النقل السريع الأطول في إسطنبول (المترو بوس)، إضافة إلى توافر كافة أنواع المواصلات العامة والخاصة.</p>\r\n<p>وكما يمكنك التنقل إلى Mecidiyek&ouml;y ، Şişli و Nişantaşı في غضون دقائق كما&nbsp; يمكنك الوصول إلى الساحل عبر نفق Dolmabah&ccedil;e والطريق السريع TEM عبر نفق Kağıthane بالإضافة الى إمكانية&nbsp; التنقل عبر محطات مترو الأنفاق Şişli / Mecidiyek&ouml;y و Osmanbey &nbsp;و التي تقع على مسافة قريبة من المشروع.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(24, 22, 'ar', 'PALM MARIN ISTANBUL', 'ياعقوبلو - بيليك دوزو', '<p>يمتد المشروع على أرض مساحتها 26.893 متر مربع مؤلفة من 19 مبنى محتوية على 330 شقة مزودة بشرفات واسعة ..</p>\r\n<p>يشمل المجمع مجموعة كاملة من المرافق و الخدمات الاجتماعية بما في ذلك 19.500 متر مربع من المناظر الطبيعية ، والممرات المائية ، ومسارات المشي والحدائق</p>\r\n<p>&nbsp;</p>\r\n<p>عند تملكك بمشروعنا &nbsp;سيصبح البحر جزءا من حياتك , الصفاء والهواء النقي وأشعة الشمس الدافئة ...</p>\r\n<p>بخطوات قليلة على الأقدام من بيتك بإمكانك الوصول الى أجمل <strong>مارينا</strong> موجودة في اسطنبول ...</p>\r\n<p>مع إطلاله الطريق الساحلي الخلابة ستضيف مع جمال البحر طاقة جديدة الى حياتك ...</p>\r\n<p>&nbsp;</p>\r\n<p><strong>نمط الشقق المتوفرة:</strong></p>\r\n<p><strong>2+1 </strong>تبدأ من <strong>100 </strong>متر مربع الى <strong>127</strong> متر مربع</p>\r\n<p><strong>3+1</strong> تبدأ من <strong>165</strong> متر مربع</p>\r\n<p><strong>4+1</strong> تبدأ من <strong>200</strong> متر مربع</p>\r\n<p>إضافة الى الشقق <strong>المزدوجه</strong> التي تبدأ مساحتها عند 175 متر مربع</p>\r\n<p>&nbsp;</p>\r\n<p><strong>سيتم تسليم المشروع في نهاية عام 2020</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>الخدمات الإجتماعية:</strong></p>\r\n<p>ملعب كرة قدم&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; مسابح مغلقة</p>\r\n<p>مسجد&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; حمام تركي</p>\r\n<p>حدائق&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; ساونا&amp;غرف بخار</p>\r\n<p>أماكن مخصصة للأطفال &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; صالات رياضية</p>\r\n<p>مقاهي&amp;مطاعم&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; مواقف سيارات مغلقة</p>\r\n<p>مدارس&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;ملعب كرة سلة</p>\r\n<p>حماية 7/24</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>الموقع: </strong></p>\r\n<p>&nbsp;</p>\r\n<p>يقع المشروع في منطقة <strong>ياكوبلو</strong> ضمن مقاطعة <strong>بيلكدوزو</strong> الموجودة في الطرف الآوربي من مدينة اسطنبول ...</p>\r\n<p>&nbsp;</p>\r\n<p>من المناطق المميزة والنادرة التي توفر عدة طرق وصول بديلة هي منطقة <strong>ياكوبلو</strong> حيث أنها من الممكن الوصول لها بسهولة عن طريق :</p>\r\n<p>&nbsp;</p>\r\n<p><strong>IDO1</strong>- &nbsp;المواصلات البحرية ( الوصول من <strong>بشكتاش</strong> , <strong>الفاتح</strong> , <strong>الطرف</strong> <strong>الآسيوي</strong> ) عن طريق محطة</p>\r\n<p>&nbsp;</p>\r\n<p><strong>E5</strong> / <strong>E80</strong> <strong>2</strong>- المواصلات العامة</p>\r\n<p>&nbsp;</p>\r\n<p>أيضا تتميز منطقة <strong>ياكوبلو</strong> بقربها من <strong>مطار</strong> <strong>أتاتورك</strong> الدولي ( <strong>25</strong> <strong>كم</strong> ) <strong>ومطار اسطنبول </strong>الجديد *<strong>المطار الثالث</strong>* ( <strong>46</strong> <strong>كم</strong> ) ...</p>\r\n<p>&nbsp;</p>\r\n<p>تتميز المنطقة بهدوءها التام وعدم وجود الإزدحام المروري....</p>\r\n<p>&nbsp;</p>\r\n<p>تماما من القرب من بحر مرمرة تتميز المارينا الموجودة بجانب المشروع بوجود فندق , مدرسة , مستشفى , شواطئ , وسلسلة مطاعم ومقاهي فخمة .</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(25, 23, 'ar', '3RD ISTANBUL', 'إسطنبول - باشاك شهير ', '<h3>أهم ثلاثة أسباب للشراء في أكبر مشروع في اسطنبول</h3>\r\n<p>يتم انشاء مشروع اسطنبول الثاثة من اتحاد شركات دولية معروفة.</p>\r\n<div class=\"project_one\">\r\n<p>دعم كامل من الحكومة التركية حيث أنه مضمون ومدعوم من بلدية باشاك شهير.</p>\r\n<p>موقع المشروع المميز في حي باشاك شهير والذي يعتبر من أفضل مناطق الاستثمار في اسطنبول.</p>\r\n<p>وجود المشروع بجانب أكبر حديقة نباتية في تركيا، وبجانب الميدان الحكومي الجديد المخطط أن تكون مساحته ضعف ميدان تقسيم.</p>\r\n<p>بالإضافة إلى كون المشروع ملاصق لأكبر مدينة طبية في أوروبا، والمخطط أن تتكون من تسع مشافي كبيرة بمختلف الاختصاصات.</p>\r\n<p>مما يجعل من المشروع فرصة استثمارية حقيقية.</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<h2>عن مشروع اسطنبول الثالثة</h2>\r\n<ul>\r\n<li>مساحة المشروع : 115.847 متر مربع.</li>\r\n<li>مساحة البناء : 330.467 متر مربع.</li>\r\n<li>مجموع الواحدات السكنية : 1.227</li>\r\n<li>مجموع الوحدات التجارية : 209</li>\r\n<li>أنواع الشقق : 2+1 3+1 4+1</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h2>موقع مشروع اسطنبول الثالثة</h2>\r\n<ul>\r\n<li>تقع قريبة من المحاور الرئيسية للمدينة ومراكز التجارة والأحياء السكنية, مع سهولة الوصول الى وسائل النقل العام والمترو والترام وحافلات النقل العام.. كما أنها تقع في الوسط بين مطار أتاتورك والمطار الثالث الجديد.</li>\r\n<li>يبعد المشروع دقيقتين فقط عن محطة المترو متروكنت.</li>\r\n<li>يبعد 5 دقائق فقط عن الاوتستراد السريع تيم.</li>\r\n<li>يبعد 12 دقيقة عن الاوتستراد السريع اي 5</li>\r\n<li>يبعد 12 دقيقة فقط عن مطار اسطنبول الثالث الجديد.</li>\r\n<li>يبعد 12 دقيقة عن مطار أتاتورك الدولي.</li>\r\n<li>ويبعد 20 دقيقة عن جسر البوسفور الثالث الجديد.</li>\r\n<li>المشروع قريب من جامع صلاح الدين ثاني أكبر جامع في إسطنبول.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>لماذا منطقة باشاك شهير وأبرز ما يميز الموقع:</strong></p>\r\n<h4>- حداثة المنطقة: تعتبر منطقة باشاك شهير من احدث المناطق في تركيا حيث تجتمع البنى التحتية العصرية مع الهندسة والتخطيط العصريين.</h4>\r\n<p><strong>- قبلة للمستثمرين وأصحاب الأعمال: حداثة المنطقة وتنوع معالمها ومشاريعها جعلها قبلة للمستثمرين واصحاب الأعمال ما دعا الحكومة التركية إلى الاهتمام بها على وجه خاص فأصبحت تمتلك أعلى معايير الرفاهية والراحة حيث تتوفر الابنية المتينة المضادة للزلازل والمرافق الاجتماعية المتنوعة والكثيرة ومنها ما هو الافضل على مستوى اوروبا.</strong></p>\r\n<p><strong>- المواصلات: تتوفر في منطقة باشاك شهير العديد من محطات الباصات و محطات المترو ويتم انشاء عدة محطات مترو وترام واي جديدة.</strong></p>\r\n<p><strong>- أشهر معالم المنطقة: اكبر حديقة نباتية في اوروبا اكبر مدينة طبية في الشرق الأوسط اكبر ميدان في تركيا تبعد عن اكبر مطار في العالم (مطار اسطنبول الجديد) عدة كيلومترات تبعد عن مطار اتاتورك عدة كيلومترات وادي باشاك شهير.</strong></p>\r\n<p><strong>- المدارس والجامعات: تحتوي المنطقة على العديد من المدارس العربية والدولية بمختلف المراحل التعليمية بالإضافة للعديد من الجامعات.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>');
