(26, 24, 'ar', 'VADIYAKA', 'إسطنبول - باشاك شهير', '<p>- يقع مشروع وادي ياكا باشاك شهير في حي باشاك شهير بمدينة إسطنبول على مساحة 17ألف و609 مترمربع.</p>\r\n<p>- المشروع مكون 365 شقة موزعة على عدد من الابراج السكنية 2+1 و 3+1 و 4+1 بالاضافة الى 56 محل تجاري.</p>\r\n<p>- المشروع قريب جدا من مركز التسوق Olimpa Alışveriş Merkezi حيث تتوفر امكانية التسوق من الماركات العالمية و الاستمتاع بالمقاهي و المطاعم في جو من الفخامة و الرفاهية.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>لماذا منطقة باشاك شهير وأبرز ما يميز الموقع:</strong></p>\r\n<h4>- حداثة المنطقة: تعتبر منطقة باشاك شهير من احدث المناطق في تركيا حيث تجتمع البنى التحتية العصرية مع الهندسة والتخطيط العصريين.</h4>\r\n<p><strong>- قبلة للمستثمرين وأصحاب الأعمال: حداثة المنطقة وتنوع معالمها ومشاريعها جعلها قبلة للمستثمرين واصحاب الأعمال ما دعا الحكومة التركية إلى الاهتمام بها على وجه خاص فأصبحت تمتلك أعلى معايير الرفاهية والراحة حيث تتوفر الابنية المتينة المضادة للزلازل والمرافق الاجتماعية المتنوعة والكثيرة ومنها ما هو الافضل على مستوى اوروبا.</strong></p>\r\n<p><strong>- المواصلات: تتوفر في منطقة باشاك شهير العديد من محطات الباصات و محطات المترو ويتم انشاء عدة محطات مترو وترام واي جديدة.</strong></p>\r\n<p><strong>- أشهر معالم المنطقة: اكبر حديقة نباتية في اوروبا اكبر مدينة طبية في الشرق الأوسط اكبر ميدان في تركيا تبعد عن اكبر مطار في العالم (مطار اسطنبول الجديد) عدة كيلومترات تبعد عن مطار اتاتورك عدة كيلومترات وادي باشاك شهير.</strong></p>\r\n<p><strong>- المدارس والجامعات: تحتوي المنطقة على العديد من المدارس العربية والدولية بمختلف المراحل التعليمية بالإضافة للعديد من الجامعات.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(27, 25, 'ar', 'Radius Residence', '', '<p><strong>يقع مجمع راديوس اسنيورت&nbsp;غربي اسطنبول الاوروبية في&nbsp; أجمل مناطق المدينة، بسبب اطلالته على بحر مرمرة، وعلى الحدائق الخضراء، و يحوي حدائق ومسطحات مائية &nbsp;مما يضفي على المشروع لمسة جمالية طبيعية .</strong></p>\r\n<p><strong>يتميز بهندسة معمارية فريدة تسمح لك بالاسترخاء بشكل مريح في بقاع فسيحة مع منظر خلاب . بالإضافة لوجود العديد من الأبنية السكنية الفاخرة التي ازدهرت في الآونة الاخيرة و مازالت في ازدهار.</strong></p>\r\n<p><strong>الدفع بالتقسيط وبدون فوائد دفعة اولى 35% والباقي تقسيط على 36 شهر بدون فوائد حيث ان التقسيط متاح لجميع الجنسيات.</strong></p>\r\n<p><strong>سيتم تسليم المجمع في نهاية 2019.</strong></p>\r\n<p><strong>موقع بلدية اسنيورت على الانترنت: </strong><strong><a href=\"https://www.esenyurt.bel.tr/tr/\">Esenyurt Belediyesi</a></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(28, 26, 'ar', 'Radius Residence ', 'Esenyurt', '<p>مجمع راديوس ريزيدانس في اسطنبول الاوروبية</p>\r\n<p>الأن أحصل على فرصة امتلاك شقة سكنية في اسطنبول وكن من الأوائل الذين يحصلون على شقة سكنية من المشروع الجديد مع أسعارٍ تبدأ من 65 الف دولار .</p>\r\n<p>تنقسم الشقق السكنية للمشروع إلى شقق 1+1 غرفة نوم وصالة للجلوس , 2+1, .طريقة الدفع عن طريق الأقساط بدفعة بنسبة 35% والبافي 48 شهر .......</p>\r\n<p>شققنا السكنية تمتاز بقربها من مراكز التسوق ،مطار أتاتورك الدولي ، محطة المتروبوس ، والعديد من الجامعات والمستشفيات....</p>\r\n<p>في مجمع راديوس نقوم ببناء عالم من أحلامك.....</p>\r\n<p>&nbsp;</p>\r\n<p>- يقع مجمع راديوس اسنيورت غربي اسطنبول الاوروبية في أجمل مناطق المدينة، بسبب اطلالته على بحر مرمرة، وعلى الحدائق الخضراء، و يحوي حدائق ومسطحات مائية &nbsp;مما يضفي على المشروع لمسة جمالية طبيعية .</p>\r\n<p>- يتميز بهندسة معمارية فريدة تسمح لك بالاسترخاء بشكل مريح في بقاع فسيحة مع منظر خلاب . بالإضافة لوجود العديد من الأبنية السكنية الفاخرة التي ازدهرت في الآونة الاخيرة و مازالت في ازدهار.</p>\r\n<p>- يمتد المشروع على مساحة 20000 متر مربع, و يضم 376 وحدة سكنية على 6 طوابق, و 33 محل تجاري.</p>\r\n<p>&nbsp;</p>\r\n<h4><strong>وصف المشروع:</strong></h4>\r\n<ul>\r\n<li>مسبح للكبار ومسبح للصغار غرفة ملابس، نادي لياقة، مصلى، باركينغ.</li>\r\n<li>قربه من الخط السريع.</li>\r\n<li>وجوده بجانب جامعة اسنيورت مما يسهل الاستثمار فيه.</li>\r\n<li>يبعد عن مطار أتاتورك 26 كم.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>تفاصيل المشروع:</strong></p>\r\n<ul>\r\n<li>موعد التسليم : 12/2019</li>\r\n<li>نظام التقسيط : بدون دفعة أولى و تقسيط لــ&nbsp;60&nbsp;شهر.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>\r\n<p><strong>Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(29, 27, 'ar', 'BaşakCity Boutique', 'باشاك شهير', '<p>يوفر BaşakCity Boutique المجاور لأكبر مدينة صحية في أوروبا مع أكبر حديقة نباتية في أوروبا، كل ما تبحث عنه بموقعه الفريد. وذلك بالقرب من المترو وسيارات النقل العام.&nbsp;علاوة على ذلك، سوف تكون قادرًا على تلبية جميع احتياجاتك بفضل المتاجر في BaşakCity.</p>\r\n<p>مقابل محطة الحافلات، توفر المتاجر في الشوارع على بعد 250 متر من المترو للمستثمرين، فرصة أن يكونوا في منتصف الممشى والمستوطنة مباشرة. وهي تقع تقع في قلب التجارة بفضل مشاريع الإسكان المؤهلة ومراكز التسوق والمدارس والمراكز الصحية حول متاجر Cadde.</p>\r\n<p>تقع المحلات التجارية لشارع باشك سيتي في قلب باشك شهير، وتبعد فقط 250 متر عن محطة المترو، في حين تقع محطة الباص مقابلها مباشرةً. كما إنّ موقع شارع باشك شهير الفريد من نوعه جعل من المشروع فرصة ممتازة للمستثمرين ورجال الأعمال. يحيط بالمشروع عدة مراكز تسوق ومدارس ومشافي بالإضافة إلى مشاريع سكنية.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>لماذا منطقة باشاك شهير وأبرز ما يميز الموقع:</strong></p>\r\n<h4>- حداثة المنطقة: تعتبر منطقة باشاك شهير من احدث المناطق في تركيا حيث تجتمع البنى التحتية العصرية مع الهندسة والتخطيط العصريين.</h4>\r\n<p><strong>- قبلة للمستثمرين وأصحاب الأعمال: حداثة المنطقة وتنوع معالمها ومشاريعها جعلها قبلة للمستثمرين واصحاب الأعمال ما دعا الحكومة التركية إلى الاهتمام بها على وجه خاص فأصبحت تمتلك أعلى معايير الرفاهية والراحة حيث تتوفر الابنية المتينة المضادة للزلازل والمرافق الاجتماعية المتنوعة والكثيرة ومنها ما هو الافضل على مستوى اوروبا.</strong></p>\r\n<p><strong>- المواصلات: تتوفر في منطقة باشاك شهير العديد من محطات الباصات و محطات المترو ويتم انشاء عدة محطات مترو وترام واي جديدة.</strong></p>\r\n<p><strong>- أشهر معالم المنطقة: اكبر حديقة نباتية في اوروبا اكبر مدينة طبية في الشرق الأوسط اكبر ميدان في تركيا تبعد عن اكبر مطار في العالم (مطار اسطنبول الجديد) عدة كيلومترات تبعد عن مطار اتاتورك عدة كيلومترات وادي باشاك شهير.</strong></p>\r\n<p><strong>- المدارس والجامعات: تحتوي المنطقة على العديد من المدارس العربية والدولية بمختلف المراحل التعليمية بالإضافة للعديد من الجامعات.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(30, 28, 'ar', 'G YOO ', 'BAĞCILAR', '<div class=\"elementor-element elementor-element-daec31a elementor-widget elementor-widget-heading\" data-id=\"daec31a\" data-element_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">أتت هذه الثقافة المعمارية من إستخدام الأشياء والأفكار الماضية التي تم تصميمها بشكل جميل والتي تبناها \"ستارك\" بشغف، وترتبط بالتصاميم الأكثر دهشة في عصرنا. والنتيجة هي مزيج رائع من الأسهم المثيرة للإعجاب.</span></strong></div>\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">قام بتصميم المشروع المهندس المعماري المشهور phillipe strack على شكل مثلث لكي تكون جميع الشقق معرضة للشمس، وللتصميم فائدة أخرى وهي: عدم وجود إطلالة شمالية مباشرة للشقق.</span></strong></div>\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">يتكون المشروع من مبنيان، كل منهما يضم 32 طابق يحتويان على 721 شقة فاخرة، وفندق يضم 60 غرفة وأقسام تجارية.</span></strong></div>\r\n<div class=\"elementor-widget-container\">&nbsp;</div>\r\n<div class=\"elementor-widget-container\">&nbsp;</div>\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">ومن أهم مميزات المشروع:</span></strong></div>\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">- أحواض سباحة خارجية ومغلقة.</span></strong></div>\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">- ساونا.</span></strong></div>\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">- حمام تركي.</span></strong></div>\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">- غرفة بخار.</span></strong></div>\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">- مركز للياقة البدنية.</span></strong></div>\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">- صالة للإجتماعات.</span></strong></div>\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">- صالة للأعمال.</span></strong></div>\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">- خدمة الإستقبال.</span></strong></div>\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">- ميزة البيت الذكي.</span></strong></div>\r\n<div class=\"elementor-widget-container\">&nbsp;</div>\r\n<div class=\"elementor-widget-container\"><strong><span class=\"elementor-heading-title elementor-size-default\">والعديد من المميزات الأخرى التي تمتاز بها تلك التحفة المعمارية.</span></strong></div>\r\n<div class=\"elementor-widget-container\">&nbsp;</div>\r\n<div class=\"elementor-widget-container\">&nbsp;</div>\r\n<div class=\"elementor-widget-container\">\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-4f2cd713 bdt-social-share-buttons-view-icon bdt-social-share-buttons-shape-rounded bdt-social-share-buttons-align-center bdt-social-share-buttons-style-flat bdt-ep-grid-0 bdt-social-share-buttons-color-original elementor-widget elementor-widget-bdt-social-share\" data-id=\"4f2cd713\" data-element_type=\"bdt-social-share.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"bdt-social-share bdt-ep-grid\">\r\n<div class=\"bdt-social-share-item bdt-ep-grid-item\">\r\n<div class=\"bdt-social-share-button bdt-social-share-button-facebook\" data-social=\"facebook\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),
(31, 29, 'ar', 'PRİME İSTANBUL RESİDENCES', 'Yenibosna Merkez Mahallesi, 1. Asena Sk No:15, 34197 Bahçelievler/İstanbul', '<p><span class=\"yellow\">نقدم لكم مشروع PRİME İSTANBUL RESİDENCES المتميز بقربه من مركز اسطنبول ، بكونه مشروع استثماري مربح و سكني مريح ذو خدمات فندقيه عاليه حيث يتواجد بالمشروع فندقين فخمين 5 نجوم Pullman hotel, Mercure hotel , قاعة مؤتمرات عالميه Pullman convention center . فقام بتلبيه ثقه و كافة احتياجات و متطلبات عملاءه الكرام.</span></p>\r\n<p>&nbsp;</p>\r\n<p><strong>من صفات المشروع:</strong></p>\r\n<p>مجمع حديث للغاية ذو مساكن متطورة و أنيقة مختلفه عن باقي المشاريع بنوع 1+0 1+1 1+2 3+1 1+4 في 4 بلوكات ذات 12 طابق بتشطيب لوكس سواء خارجي او داخلي.</p>\r\n<p><strong>من مميزات موقع المشروع:</strong></p>\r\n<p>يعتبر موقع Prime İstanbul Residences استراتيجي بنسبه عاليه حيث انه متواجد مباشرة على :</p>\r\n<p>- طريق الباسن اكسبرس المصنف كمركز مستقبلي للتمويل والسياحة يضم اكثر من 33 فندق خمس نجوم . كذلك يحتوي على ثروه عمرانيه و خدماتية فتقام به عدة مشاريع عصريه للشركات الكبرى الأجنبية و التركيه باعتباره موقع استثماري مربحا.</p>\r\n<p>و ليس فقط على باسن اكسبرس ايضا المشروع على خط E5 يعني ايضا على خط المتروبوس، وعلى قرب كبير من مطار اتاتورك.</p>\r\n<p>- محيط به اكبر المولات ( مول اف اسطنبول ، ميتروبول ، ٢١٢ ، فينيسيا مول ..)، وجامعات ومدارس هامه ( estinye university, elfenar school... )، ومشافي ( Medipol , Memorial...). وعلى قرب من بحيرة كشكشكمجا (قناة اسطنبول الجديده).</p>\r\n<p>&nbsp;</p>\r\n<p><strong>بالنسبة لموضوع المواصلات:</strong></p>\r\n<p>- محطه المتروبوس ينببوسنا او صفاكوي.</p>\r\n<p>- محطة مترو الإنفاق اتاكوي.</p>\r\n<p>- محطة المترو الإنفاق الجديده على باسن اكسبرس ستبتدا في نهاية ٢٠١٩.</p>\r\n<p>- محطة تاكسي خاصه بالمشروع.</p>\r\n<p>- كافة المواصلات على طريق الباسن اكسبرس.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات الداخلية للمشروع:</strong></p>\r\n<p>- يوفر جميع وسائل الراحة و يلبي كافه الاحتياجات اليومية حيث ان المشتري يستفاد من الأمن الفندقي و الخدمات الفندقية ، فالمسابح و الحمامات ، الجاكوزي ، مساج ، صالة رياضة ، كافيهات و مطاعم ، لوبي فخم . وكذلك مع تنظيف للشقق مجاني لمدة سنتين من قبل موظفين الفندق.</p>\r\n<p>- يتميز ايضا PRIME ISTANBUL RESIDENCES بكون المواد الإنشائية التي تم استخدامها لجوده عاليه و إتقان . من جميع النواحي.<br />- الشقق ذات إطلالات مختلفه سواء على الطريق السريع او على التاكسي البحري مباشرة . و كذلك تكون مجهزة من كافة المستلزمات للكرومنزلية مع تنظيف و تشطيب لوكس الشقه.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>طريقة الدفع تكون:</strong></p>\r\n<p>- 50% دفعه اولى مع تقسيط سنتين.<br />- 50% دفعه اولى الباقي تقسيط سنه.<br />- كاش.<br />مع استلام فوري للشقه.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(32, 30, 'ar', 'TUAL BAHÇEKENT - توال بهشاكنت', '', '<p>- يقع المجمع السكني&nbsp; TUAL BAH&Ccedil;EKENT في منطقة اسطنبول الجديدة في بهشاكنت&nbsp; شمال غرب اسطنبول في نطاق بلدية بشاكشهير .</p>\r\n<p>- يقدم توال بهشاكنت خيارات شقق مختلفة من 1 + 1 إلى 4 + 1، ويضم 2000 شقة ووحدات تجارية. سيكون لديك حياة مزدهرة في متناول يديك و تقديم الحلول المختلفة لجميع التوقعات في توال بهشاكنت.</p>\r\n<p>الأمر الذي يحدث فرقا مع المعايير المعمارية العالية والجودة في البناء المتميز.توال بهشاكنت يجعل &nbsp;الحياة على اتصال مع الطبيعة بفضل مساراتها الطويلة المنظمة، والمناظر الطبيعية ، وتكنولوجيات البناء الصديقة للبيئة.</p>\r\n<p>- من المقرر أن يوفر توال بهشاكنت كل مبنى مع إطلالة على حديقة الحياة، مما يتيح لك الاستمتاع بلحظات هادئة في الهواء النقي وتجنب التلوث و الضجيج في المنازل أو الحديقة أو البلكونة الخاصة بك.</p>\r\n<p>- في توال بهشاكنت، سيارتك في مرآب للسيارات، والتي يمكن الوصول إليها بسهولة بفضل التصميمات والتي تركز على الأمان والراحة.</p>\r\n<p>- يعيد توال بهشاكنت تفسير مفهوم المدينة الحديثة بمناظرها الطبيعية الشاسعة وطبيعتها الخضراء لموقعها المطل على حديقة حياة بارك التي تبلغ مساحتها 160،000 متر مربع، وهي مرشحة لتصبح مركز جذب في إسطنبول.</p>\r\n<p>- توال بهشاكنت تستضيف المؤسسات التعليمية المرموقة من المدارس الخاصة والعامة، ورياض الأطفال مع المرافق التعليمية المصممة أساسا للطلاب &nbsp;بمواصفات عالية الجودة، والتي يمكن الوصول إليها من قبل أطفالك في غضون بضع دقائق دون معاناة من حركة المرور.</p>\r\n<p>&nbsp;- مجالات الحياة السعيدة هنا هي: حمام سباحة داخلي، ساونا، حمام بخار، مركز للياقة البدنية، ملاعب للأطفال، مسارات للتنزه، كراجات للسيارات، ،مستشفى خاص، ومسجد. &nbsp;</p>\r\n<p>- توفر لك اسطنبول الجديدة الفرص البيئية والحضارية والتي تنحصر ،في توال بهشاكنت وستفتح أبواب الحياة السعيدة لك ولعائلتك، في حين أن تحويل قيمة هذه الحياة إلى قيمة اقتصادية قوية بمساعدة موقعها في واحدة من المناطق الواعدة في اسطنبول.</p>\r\n<p>&nbsp;</p>\r\n<p>لماذا منطقة باشاك شهير وأبرز ما يميز الموقع:</p>\r\n<p>- حداثة المنطقة: تعتبر منطقة باشاك شهير من احدث المناطق في تركيا حيث تجتمع البنى التحتية العصرية مع الهندسة والتخطيط العصريين.</p>\r\n<p>- قبلة للمستثمرين وأصحاب الأعمال: حداثة المنطقة وتنوع معالمها ومشاريعها جعلها قبلة للمستثمرين واصحاب الأعمال ما دعا الحكومة التركية إلى الاهتمام بها على وجه خاص فأصبحت تمتلك أعلى معايير الرفاهية والراحة حيث تتوفر الابنية المتينة المضادة للزلازل والمرافق الاجتماعية المتنوعة والكثيرة ومنها ما هو الافضل على مستوى اوروبا.</p>\r\n<p>- المواصلات: تتوفر في منطقة باشاك شهير العديد من محطات الباصات و محطات المترو ويتم انشاء عدة محطات مترو وترام واي جديدة.</p>\r\n<p>- أشهر معالم المنطقة: اكبر حديقة نباتية في اوروبا اكبر مدينة طبية في الشرق الأوسط اكبر ميدان في تركيا تبعد عن اكبر مطار في العالم (مطار اسطنبول الجديد) عدة كيلومترات تبعد عن مطار اتاتورك عدة كيلومترات وادي باشاك شهير.</p>\r\n<p>- المدارس والجامعات: تحتوي المنطقة على العديد من المدارس العربية والدولية بمختلف المراحل التعليمية بالإضافة للعديد من الجامعات.</p>\r\n<p>&nbsp;</p>\r\n<p>الخدمات التي نقدمها للعميل:</p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.&nbsp;</p>\r\n<p>الهاتف: 00905356865688</p>\r\n<p>البريد الإلكتروني: yahya@alrawi.co</p>\r\n<p>الموقع الإلكتروني:&nbsp;alrawi.co</p>\r\n<p>الفيس بوك:&nbsp;facebook.com/AlrawiCom</p>\r\n<p>&nbsp;</p>\r\n<p>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</p>'),
(33, 31, 'ar', 'EBRULİ ISPARTAKULE - مشروع إبرولي إسبارتاكوليه', 'إسطنبول - إسبارتاكوليه', '<p>يقدم Ebruli Ispartakule مناطق سكنية حديثة، ويتميز بشقق ذات تفاصيل فخمة ومريحة.</p>\r\n<p>في مشروع Ebruli Ispartakule، توجد وحدات سكنية مكونة من أربعة طوابق وأبراج مكونة من 28 طابقًا، ويتم توفير أولوية السكن العائلي للمستثمرين.</p>\r\n<p>ويتكون مشروع Ebruli Ispartakule من شقق واسعة وفسيحة 2+1، و3+1، و4+1 تبدأ مساحتها من 114، و162، و192 مترًا مربعًا على التوالي، وكما يحتوي على 724 منزلاً و52 متجرًا على الشارع.&nbsp;</p>\r\n<p>تم بناء مشروع Ebruli Ispartakule على مساحة 41.168 مترًا مربعًا، ويُعتبر من أكثر المشروعات السكنية المطلوبة في المنطقة.</p>\r\n<p>يقدم المشروع، تحت رعاية شركة &Ouml;zg&uuml;ven Architecture،&nbsp;مساحات سكنية فسيحة للمشترين، ومناظر طبيعية، ومساحات خضراء تبلغ مساحتها 6 ألاف متر مربع. ويشمل المشروع مساحة قدرها 26.898 مترًا مربعًا مخصصة للمناظر الطبيبعة، بالإضافة إلى حمامات السباحة المغلقة، وغرف ممارسة الهوايات، وفصول تعليم النحت، ومركز لياقة بدنية، وحمام تركي، وحمام بخار فنلندي، وحمام بخار عادي.</p>\r\n<p>تم تصميم مشروع Ebruli Ispartakule في منطقة تضم مؤسسات تعليمية، ويحتوي أيضًا على مقهى ومطاعم، وموقف سيارات مغلق يتسع لـ 1050 سيارة، ومنطقة مرافق اجتماعية مساحتها 774 مترًا مربعًا.</p>\r\n<p>يجذب الانتباه من خلال الخصائص البيئية ستتم إضاءة المناطق المشتركة في Ebruli Ispartakule باستخدام الطاقة المتجددة، وستحتوي مواقف السيارات على وحدات شحن كهربية.</p>\r\n<p>بالإضافة إلى ذلك، ستتم تنقية مياه الصرف ومياه الحمامات في بحيرة المياه الرمادية، وسيتم استخدامها في ري الحدائق والمناظر الطبيعية.</p>\r\n<p>سيقدم مشروع Ebruli Ispartakule لسكان العقارات السكنية ميزة توفير المياه والطاقة.</p>\r\n<p>يقع في منطقة محاطة بشبكة مواصلات يقع مشروع Ebruli Ispartakule بالقرب من TEM، ويتمتع بموقع متميز فيما يتعلق بالمواصلات.</p>\r\n<p>يقع المشروع على بعد مسافة قصيرة سيرًا على الأقدام من محطة مترو تحت الإنشاء، وفي نقطة التقاء العديد من المشروعات مثل طريق شمال مرمرة السريع، وكوبري Yavuz Sultan Selim، والمطار الثالث.</p>\r\n<p>تقع منطقة المشروع، على بعد دقيقة واحدة من TEM، و12 كيلو متر من مطار أتاتورك، 24 كيلو متر من المطار الثالث، مما يجعل منطقة مشروع Ebruli Ispartakule أحد المواقع المفضلة في المدينة.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(34, 32, 'ar', 'Demir Country- دمير كانتري', 'إسطنبول الأوربية - حي أفجلار - منطقة يعقوبلو', '<p>نبذة عن المشروع</p>\r\n<p>يقع المشروع في منطقة يعقوب لو التابعة إداريا لبلدية بيلك دوزو<br />تم تصميم وإنشاء مشروع ديمير كانتري بذوق رفيع و فريد من قبل Demir İnşaat<br />يوجد خيارات شقق مختلفة من 1 + 1 إلى 4 + 1، و المشروع يضم 1160شقة<br />يضم المشروع 113 وحدة تجارية مصممة لتكون مقاهي ومطاعم ومراكز تسوق<br />يقع المشروع على مساحة 44,426 متر مربع بمساحة بناء تبلغ 245,333 متر مربع<br />يطل المشروع على على بحر مرمرة حيث يبعد عن المارينا مسافة 1.5 كم<br />المساحات الخضراء في المشروع تبلغ أكثر من 20.000 متر مربع<br />سند الملكية جاهز ويمكنك التملك مباشرة<br />تنتهي أعمال الإنشاءات في العام 2020 الشهر السادس</p>\r\n<p>&nbsp;</p>\r\n<p>:محيط المشروع</p>\r\n<p>يبعد 5 دقائق محطة المتروبوس<br />يبعد 5 دقائق عن الطريق السريع<br />يبعد 5 دقائق عن الطرقة السريعة الرئيسية<br />يبعد 1.5 كم عن حديقة الوادي الأخضر<br />يبعد 1.5 كم دقائق عن ساحل بحر مرمرة<br />يبعد 30 دقيقة عن المطار الجديد<br />بالإضافة إلى قربه من المطاعم، المشافي، المدارس</p>\r\n<p>&nbsp;</p>\r\n<p>ميزات المشروع:</p>\r\n<p>تصميم معماري وداخلي مميز<br />التشطيب الداخلى للوحدات على اعلى مستوى<br />مساحة 1000 متر مربع مخصص للأنشة الاجتماعية والترفيهية <br />مساحات واسعة من الحدائق والممرات المائية داخل المشروع<br />أحواض سباحة مغلقة ومفتوحة<br />تبضع وأسواق مفتوحة بداخل المشروع<br />مسارات طويلة للمشي والرياضة <br />بالقرب من المارينا ومن ساحل البحر<br />بالقرب من مدارس المنطقة<br />بالقرب من شبكة المواصلات العامة</p>\r\n<p>&nbsp;</p>\r\n<p>تقرير العقارات في منطقة المشروع:</p>\r\n<p>- وقت الاسترداد : 18 سنة<br />- إرتفاع اسعار بيع العقارات خلال 5 سنوات: 75.7٪<br />- إرتفاع اسعار تأجير العقارات خلال 5 سنوات: 63.2٪<br />- مجموع سكان المنطقة: 331.525 نسمة<br />-الوضع الاجتماعي الاقتصادي: B<br />-الحالة الاجتماعية: 25٪ أعزب / 64٪ متزوج</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(35, 33, 'ar', 'FIRUZE KONAKLARI - قصور الفيروز ', 'إسطنبول - أفجلار ', '<p>نبذة عن المشروع</p>\r\n<p>يقع المشروع في منطقة الجامعة التابعة إداريا لبلدية أفجلار<br />تم تصميم وإنشاء مشروع قصور الفيروز بعناية تامة من شركة Kale Holding<br />يتميز المشروع بإطلالته على بحيرة&nbsp; كوشوك شكمجة وبحر مرمرة مباشرة<br />تصاميم أنيقة للمطبخ والغرف تتكامل مع الإطلالة الرائعة للمشروع<br />تم تخصيص 19000 متر مكعب للمساحات الخضراء والمائية المحيطة بالمشروع</p>\r\n<p>يتكون المشروع من 3 أبراج سكنية , على ارتفاع 7 طابق <br />خيارات الشقق تبدأ من 1 + 1 إلى 4 + 1 و المشروع يضم 523 وحدة سكنية<br />يضم المشروع 45 وحدة تجارية مصممة لتكون مقاهي ومطاعم ومراكز تسوق<br />تم تصميم نظام ذكي لإدارة المنزل ومراقبة الباب ومواقف السيارات وحديقة الأطفال<br />ارتفاع الجدران الداخلية 3.5 متر والنوافذ ممتدة من الأرض حتى السقف<br />تم الإنتهاء من أعمال الإنشاءات والمشروع جاهز للتسليم<br />سند الملكية جاهز ويمكنك التملك مباشرة والتقيدم على الجنسية التركية</p>\r\n<p>&nbsp;</p>\r\n<p>:محيط المشروع</p>\r\n<p>يبعد 800م عن محطة المتروبوس<br />يبعد 800م عن جامعة اسطنبول الشهيرة<br />يبعد 600م عن بحيرة كوتشوك شكمجة<br />يبعد 500م عن مول بيليكان<br />يبعد 3 كم دقائق عن ساحل بحر مرمرة<br />قريب من المواصلات البحرية .</p>\r\n<p>يبعد دقيقة واحدة عن الطريق السريع E5 .<br />يبعد 10 دقائق عن حديقة الحديقة المطلة على بحيرة كوشوك شكمجه G&ouml;l Parkı .</p>\r\n<p>يبعد 40 دقيقة عن المطار الجديد</p>\r\n<p>بالإضافة إلى قربه من المطاعم، المشافي، المدارس</p>\r\n<p>&nbsp;</p>\r\n<p>ميزات المشروع:</p>\r\n<p>تصميم معماري وداخلي مميز<br />التشطيب الداخلى للوحدات على اعلى مستوى<br />جميع الشقق لها إطلالة رائعة وشرفة<br />مسحات واسعة من الحدائق والممرات المائية داخل المشروع<br />مساحة للنشاطات الترفيهية والاجتماعية<br />مسارات للمشي والرياضة <br />ملاعب داخلية للأطفال تشمل ملاعب كرة سلة وكرة القدم<br />تراس بإطلالة ساحرة على المساحات الخضراء والبحيرة<br />ارتفاع الطوابق لا يتجاوز 7 طوابق <br />مواقف حافلات مباشرة أمام المشروع مباشرة</p>\r\n<p>قريب بشكل مريح من من شبكة المواصلات العامة والمواصلات البحرية .</p>\r\n<p>&nbsp;</p>\r\n<p>تقرير العقارات في منطقة المشروع:</p>\r\n<p>- وقت الاسترداد : 19 سنة<br />- ارتفاع اسعار بيع العقارات خلال 5 سنوات : 79.8٪<br />- ارتفاع اسعار تأجير العقارات خلال 5 سنوات : 62.6٪<br />- مجموع سكان المنطقة : <strong>435.625</strong> نسمة<br />-الوضع الاجتماعي الاقتصادي : B<br />-الحالة الاجتماعية : 28٪ أعزب / 61٪ متزوج</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(36, 34, 'ar', 'FOCUS EYÜP - إطلالة أيوب', 'اسطنبول - أيوب', '<p>يقع \'فوكس ايوب\' في منطقة ايوب التي تجمع بين الحضارة العثمانية القديمة والحداثة والتطور في مدينة اسطنبول.<br />يعتبر موقع المشروع مميزا جدا حيث انه يقع في وسط المدينة تقريبا فلا حاجة لقضاء وقت طويل في المواصلات من اجل الوصول الى مكان عملك او لقضاء حاجاتك اليومية كما و ان اكثرما يميزه اطلالته المفتوحة على امتداد غابات بلغراد.</p>\r\n<p>موقع المشروع:<br />*20 دقيقة عن ميدان تقسيم الذي يعتبر الميدان الأشهر في المدينة.<br />*20 دقيقة عن اكسراي والفاتح مركز المدينة.<br />*25 دقيقة عن المطارالجديد.<br />*10 دقائق عن مضيق البوسفور الذي يصل القارتين الاسيوية والاوروبية.<br />*10 دقائق عن منطقة مسلك.<br />*15 دقيقة عن منطقة شيشلي.</p>\r\n<p>*يتالف المشروع من 3 أبنية، 9 طوابق بكل واحد بمجموع 168 شقة، بأنماط سكنية متعددة 1+1, 2+1, 3+1</p>\r\n<p>الخدمات:<br />* مسبحان مغلقان واحد للكبار و الاخر للصغار.<br />* نادي رياضي.<br />* حمام تركي.<br />*ساونا.<br />*غرفة ملح.<br />* 8 شقق فندقية.<br />* حدائق ومساحات خضراء.<br />*ملعب للاطفال.<br />*ملعب كرة سلة.<br />*9محلات تجارية.<br />*كراج للسيارات.<br />* حراسة وامن، كاميرات مراقبة...</p>\r\n<p><br />المواصلات:<br />*محطتا باص تبعد الاولى 100 متر و الاخرى 150 متر من الطرفين.<br />*محطة مترو تبعد 400 متر تسليمها شهر 9 من هذا العام.<br />*محطة ترام واي تبعد 700 متر تسليمها اخر السنة.<br />*بالاضافة لوجود باصات خدمة كل 30 دقيقة تنقل من المشروع الى محطة المترو + فيا لاند.</p>\r\n<p>*يسلم المشروع شهر 3 عام 2020.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),
(37, 35, 'ar', 'bizim evler 6 - مشروع منازلنا 6', 'اسطنبول - أفجلار - اسبارتاكوليه', '<p>يعتبر المشروع واحد من أكبر المشاريع التي تقع في المنطقة حيث تبلغ مساحته 118 ألف متر مربع بمساحة إنشاء تبلغ حوالي 410 ألف متر مربع ويتكون من 13 برج.</p>\r\n<p>كما يحتوي المشروع على أنماط مختلفة للشقق تشمل 2+1، 3+1، 4+1 بالإضافة إلى العديد من الخدمات الترفيهية المتنوعة وقربه من العديد من مراكز التسوق الشهيرة.</p>\r\n<p>كما يتميز المشروع انه أمام محطة المترو مباشرة والذي سيتم الانتهاء منها في عام 2020.</p>\r\n<p>يقع على الطريق السريع TEM بالإضافة الى وجوده بالقرب من قناة اسطنبول وقربه من العديد من مراكز التسوق الشهيرة.</p>\r\n<p>&nbsp;</p>\r\n<p>البعد عن محطات المواصلات العامة:</p>\r\n<p>أقرب محطة مترو: OLİMPİYAT PARKI STATION على مسافة 4.91 km2</p>\r\n<p>أقرب محطة ترام: BAĞCILAR TRAM STATION على مسافة 13.10 km2</p>\r\n<p>&nbsp;</p>\r\n<p>البعد عن الجسور الرئيسية:</p>\r\n<p>الجسر الأول (BOSPHORUS BRIDGE) على مسافة 27.85 km2</p>\r\n<p>الجسر الثاني (FATİH SULTAN MEHMET BRIDGE) على مسافة 30.32 km2</p>\r\n<p>الجسر الثالث (3TH BRIDGE) على مسافة 37.72 km2</p>\r\n<p>&nbsp;</p>\r\n<p>البعد عن المطارات:</p>\r\n<p>المطار الأول (أتاتورك) على مسافة 12.17 km2</p>\r\n<p>المطار الثاني (صبيحة) على مسافة 53.89 km2</p>\r\n<p>المطار الثالث (الجديد) على مسافة 25.19 km2</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(38, 36, 'ar', 'bizim evler 7 - مشروع منازلنا 7', 'اسطنبول - أفجلار - اسبارتاكوليه', '<p>يتميز المشروع عن غيره باطلاله مباشرة على بحيره طبيعيه كوتشكشكمجه فقط 1.30كم للبحيرة</p>\r\n<p>يتكون المشروع من 4 أبنية بمجموع شقق 532، وكما أنه&nbsp;يحتوي على حمام سباحة مغلق وحمام سباحة للاطفال</p>\r\n<p>يخدم المشروع 29 محل تجاري</p>\r\n<p>امن وحراسه ومعايير سلامه على اعلى مستوى بالاضافة الى كاميرات مخصصه لكل شقه</p>\r\n<p>خدمات ترفيهيه متعدده (ملاعب &ndash; مطاعم &ndash; مقاهي &ndash;مواقف سيارات &ndash; العاب للاطفال &ndash; حمامات سباحه &ndash; نادي صحي &ndash; ممشى - سينما او صالة عرض ....الخ)</p>\r\n<p>يتميز المشروع انه أمام محطة المترو مباشرة والذي سيتم الانتهاء منها في عام 2020.</p>\r\n<p>يقع على الطريق السريع TEM بالإضافة الى وجوده بالقرب من قناة اسطنبول وقربه من العديد من مراكز التسوق الشهيرة.</p>\r\n<p>&nbsp;</p>\r\n<p>البعد عن محطات المواصلات العامة:</p>\r\n<p>أقرب محطة مترو: OLİMPİYAT PARKI STATION على مسافة 4.91 km2</p>\r\n<p>أقرب محطة ترام: BAĞCILAR TRAM STATION على مسافة 13.10 km2</p>\r\n<p>&nbsp;</p>\r\n<p>البعد عن الجسور الرئيسية:</p>\r\n<p>الجسر الأول (BOSPHORUS BRIDGE) على مسافة 27.85 km2</p>\r\n<p>الجسر الثاني (FATİH SULTAN MEHMET BRIDGE) على مسافة 30.32 km2</p>\r\n<p>الجسر الثالث (3TH BRIDGE) على مسافة 37.72 km2</p>\r\n<p>&nbsp;</p>\r\n<p>البعد عن المطارات:</p>\r\n<p>المطار الأول (أتاتورك) على مسافة 12.17 km2</p>\r\n<p>المطار الثاني (صبيحة) على مسافة 53.89 km2</p>\r\n<p>المطار الثالث (الجديد) على مسافة 25.19 km2</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكترو