(39, 37, 'ar', 'bizim evler 8 - مشروع منازلنا 8', 'اسطنبول - أفجلار - اسبارتاكوليه', '<p>يقع المشروع ضمن مجموعة مشاريع bizim evler&nbsp;</p>\r\n<p>يطل المشروع على بحيره كوتشكشكمجه مباشرة وعلى البحر أيضاً</p>\r\n<p>المنطقة تتمتع بالهدوء والسكينة وتغلب الطابع العائلي عليها</p>\r\n<p>يتكون المشروع من برجين بمجموع شقق 236</p>\r\n<p>خدمات ترفيهيه متعدده (ملاعب &ndash; مطاعم &ndash; مقاهي &ndash;مواقف سيارات &ndash; العاب للاطفال &ndash; حمامات سباحه &ndash; نادي صحي &ndash; ممشى - سينما او صالة عرض ....الخ)</p>\r\n<p>يتميز المشروع انه أمام محطة المترو مباشرة والذي سيتم الانتهاء منها في عام 2020.</p>\r\n<p>يقع على الطريق السريع TEM بالإضافة الى وجوده بالقرب من قناة اسطنبول وقربه من العديد من مراكز التسوق الشهيرة.</p>\r\n<p>&nbsp;</p>\r\n<p>البعد عن محطات المواصلات العامة:</p>\r\n<p>أقرب محطة مترو: OLİMPİYAT PARKI STATION على مسافة 4.91 km2</p>\r\n<p>أقرب محطة ترام: BAĞCILAR TRAM STATION على مسافة 13.10 km2</p>\r\n<p>&nbsp;</p>\r\n<p>البعد عن الجسور الرئيسية:</p>\r\n<p>الجسر الأول (BOSPHORUS BRIDGE) على مسافة 27.85 km2</p>\r\n<p>الجسر الثاني (FATİH SULTAN MEHMET BRIDGE) على مسافة 30.32 km2</p>\r\n<p>الجسر الثالث (3TH BRIDGE) على مسافة 37.72 km2</p>\r\n<p>&nbsp;</p>\r\n<p>البعد عن المطارات:</p>\r\n<p>المطار الأول (أتاتورك) على مسافة 12.17 km2</p>\r\n<p>المطار الثاني (صبيحة) على مسافة 53.89 km2</p>\r\n<p>المطار الثالث (الجديد) على مسافة 25.19 km2</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>'),
(40, 38, 'ar', 'SELF ISTANBUL - سلف اسطنبول', 'اسطنبول - اسنيورت - هراميدره', '<p dir=\"RTL\">المشروع مصمم بمعمارية عصرية تلائم كافة احتياجات الحياة المستقبلية</p>\r\n<p dir=\"RTL\">يقع المشروع <span dir=\"RTL\">على طريق</span> Beylikd&uuml;z&uuml; - Bah&ccedil;eşehir TEM في منطقة هراميدره، المعروفة باستثمار الأجانب والعرب خصوصا، ويعتبر موقع المشروع <span dir=\"RTL\">من مواقع البناء المفضلة في اسطنبول خصوصاً للمجمعات السكنية</span>.</p>\r\n<p><span dir=\"RTL\">يتألف المشروع من 4 أبنية تضم 609 شقة سكنية، بأنماط متنوعة تتراوح من 1 + 1 إلى 4 + 1، بالإضافة إلى 60 وحدة تجارية.</span></p>\r\n<p><span dir=\"RTL\">يتناسب سعر البيع في المشروع مع أسعار المنطقة وزيادة قيمة الاستثمار فيها، وذلك لقربها من المواصلات العامة وخط المتر وبوس والطريق الرئيسي بإسطنبول (<span dir=\"LTR\">E-5</span>)&nbsp;</span></p>\r\n<p>يتميز المشروع أيضا بالمساحات الخضراء الكبيرة، حيث <span dir=\"RTL\">ما يقرب من 85 ٪ من المشروع كمنطقة للمناظر الطبيعية</span>.</p>\r\n<p>يحتوي المشروع على مركز تسوق خاص يشمل متاجر من أرقى الماركات العالمية، بالإضافة إلى المرافق الاجتماعية المخصصة لكم ولعائلتكم.</p>\r\n<ul>\r\n<li><span dir=\"RTL\">موقع مركزي قريب جدا من وسائل النقل مثل المتروباص والمطار والمترو</span>.</li>\r\n</ul>\r\n<p><span dir=\"RTL\">المشروع ملائم للأطفال بمساحة مغلقة تبلغ 1.000 متر مربع مملوءة بمناطق ترفيهية وترفيهية وهوائية خاصة بالأطفال</span>.</p>\r\n<p>وفي هذا المشروع، ما مجموعه 27 فصلا دراسياً (الروضة والمدرسة الابتدائية والمدارس الثانوية).</p>\r\n<p>وكما يحتوي المشروع على منشأة اجتماعية حديثة مع بركة سباحة خارجية للبالغين والأطفال، نادي رياضي، حمام تركي، ساونا، ملاعب خارجية متعددة الأغراض، ومعدات لياقة بدنية للبالغين، وملاعب حديثة للأطفال.</p>\r\n<p>تحتوي كل شقة في المبنى على منطقة مستودع خاصة (بين 2.5 م 2 و 6.5 م 2)</p>\r\n<p>وكما يحتوي على نظام أمان 7/24 و4 مصاعد للركاب والشحن، وارتفاع السقف 3،20 متر.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>\r\n<p dir=\"RTL\">&nbsp;</p>'),
(41, 39, 'ar', 'botanica İstanbul - بوتانيكا اسطنبول', 'بوتانيكا إسطنبول ، إسنيورت جمهوريات', '<p dir=\"rtl\">يتكون المشروع من 7 ابراج سكنية،مشيدة على مساحة 28,000 متر مربع، برجين عبارة عن مكاتب بخدمات منفصلة ومدخل منفصل، و 5 ابراج سكنية على ارتفاعات مختلفة تصل الى 10 طوابق</p>\r\n<p dir=\"rtl\">يضم المشروع 477 شقة و 22 محل تجاري، جميع الشقق لها شرفة، وكما&nbsp;يحتوي مجمع بوتانيكا اسطنبول على خيارات من الشقق المصممة حسب مفهوم الأسرة 1+1 2+1 3+1 4+1.</p>\r\n<p dir=\"rtl\">يحتوي المجمع على مميزات مثل؛ البهو، الأمن، النظافة، الخدمة الفنية، موقف للسيارات، صالة اللياقة البدنية، والساونا، وحوض السباحة المغطى. فضلا عن احتوائه على ساحات مشتركة واسعة &nbsp; &nbsp; &nbsp; &nbsp; منسقة بالخضرة، لذا فأنكم ستعايشون حياة المدينة بالصورة الأكثر طبيعية.</p>\r\n<p dir=\"rtl\">وكل هذه الميزات تندمج مع الخطوط الجمالية للتصميم المعماري الحديث، والجودة العالية للمواد الإنشائية المستخدمة، لتحول المجمع إلى أماكن للمعيشة لفاخرة</p>\r\n<p dir=\"rtl\">لن تعانوا من أزمة المواصلات في بوتانيكا اسطنبول، حيث تقع مواقف المتروباص والأتوبيسات وكذلك طريق E-5 على مبعدة 100م فقط. أما مراكز التسوق مثل: مرمرة بارك، ميكروس، باوهاوس، ريال بارك فتقع بجانبكم مباشرة..</p>\r\n<p dir=\"rtl\">يبعد دقيقة عن مول Marmara park.</p>\r\n<p dir=\"rtl\">يبعد 6 دقائق عن مول Torium.</p>\r\n<p dir=\"rtl\">يبعد 8 دقائق عن مول Pelican Mall.</p>\r\n<p dir=\"rtl\">يبعد 9 دقائق عن جامعة اسنيورت.</p>\r\n<p dir=\"rtl\">يبعد 10 دقائق عن جامعة افجلار.</p>\r\n<p dir=\"rtl\">يبعد 5 دقائق عن مشفى Medicana International.</p>\r\n<p dir=\"rtl\">يبعد 5 دقائق عن حديقة اسنيورت .</p>\r\n<p dir=\"rtl\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>\r\n<p dir=\"RTL\">&nbsp;</p>'),
(42, 40, 'ar', 'AVRUPARK HAYAT - أوروبا بارك حياة', 'اسطنبول - بهجة شهير ', '<h3 class=\"auto-style2\">الإستثمار الأفضل والحياة الأجمل في مركز مدينة الحدائق بهجة شهير</h3>\r\n<p>&nbsp;</p>\r\n<p>تم إنشاء مشروع&nbsp; AVRUPARK HAYAT في منطقة Bah&ccedil;ekent في قلب إسطنبول.</p>\r\n<p>وهو يعتبر عالم حقيقي من الامتيازات يحتوي على مساحات خضراء واسعة، ورؤية تطوير عمراني نموذجية، وبنية تحتية على مستوى عالمي، وخدمات بلدية..</p>\r\n<p>تمتد مدينة إسطنبول الجديدة على مساحة أرض صلبة على مقربة من العديد من النقاط المهمة من المطار الثالث إلى طريق TEM السريع، ومن شمال مرمرة السريع وحتى مشروع قناة إسطنبول.</p>\r\n<p>يتكون مشروع AVRUPARK HAYAT، الذي تم تشييده بضمان شركة Emlak Konut التابعة للحكومة التركية بالتعاون مع شركة Cihan Construction</p>\r\n<p>إن موقع مشروع AVRUPARK HAYAT المجاور لأكبر حديقة في إسطنبول (Hayat Park) يتيح الفرصة للاستمتاع بمرافق الصحة، والخاصة بالتسوق، والمرافق الرياضية الخاصة بهذه المدينة الجديدة فضلاً عن المرافق الاجتماعية الغنية الموجودة بداخلها.</p>\r\n<p>هناك مستقبل مشرق في انتظار مشروع AVRUPARK HAYAT كأحد المشروعات المميزة في منطقة Bah&ccedil;ekent.</p>\r\n<p>توفر المنطقة فرص استثمار مميزة لمن يبادر باغتنامها قبل أن تتزايد قيمتها.</p>\r\n<p>سيضيف مشروع AVRUPARK HAYAT قيمة لاستثماراتك إذ يوفر مساحة سكنية دافئة لك ولأسرتك من خلال دمج تصميم المرافق بداخل منطقة Bah&ccedil;ekent بحيث يناسب احتياجات السكان.</p>\r\n<p>يتمتع مشروع AVRUPARK HAYAT بمساحة من المناظر الطبيعية المميزة التي ستجعلك تنعم بأجواء الطبيعة الخلابة، كما سترتقي بمستوى معيشتك من خلال اللحظات الممتعة التي ستحظى بها في الحديقة الشتوية الباهرة بعيدًا عن جو المدينة الصاخب المليء بالهواء الملوث.</p>\r\n<p>يقدم لك مشروع AVRUPARK HAYAT جميع الأنشطة المتعلقة بالحياة الحديثة التي تفتقدها في حياة المدن. كما أنه مزود بنظام مواقف سيارات يتميز بالراحة والأمان.</p>\r\n<p>لن تضيع مزيدًا من الوقت بحثًا عن مكان وقوف السيارات في Avrupark، بل ستترك سيارتك دون قلق مركونة في المكان المخصص لك داخل موقف السيارات.</p>\r\n<p>ستستمتع بمساحة سكنية نموذجية في AVRUPARK HAYAT حيث تم تصميم كل متر مربع في منزلك باستخدام مواد من الدرجة الأولى.</p>\r\n<p>يتميز مشروع Avrupark بتصميم معماري مناسب لجميع الاحتياجات، إذ يتكون من عدة منازل من 1+1 وحتى 4+1</p>\r\n<p>تم إنشاء المشروع لمستقبل مشرق ومريح، إذ إنه وفقًا للمشروع ستستمتع بضوء الشمس داخل منزلك بشكل دائم بفضل الإعداد المخطط وحسن توزيع المنزل واسع المساحة. هناك منازل تناسب مختلف الأفراد ومختلف الاحتياجات في مشروع Avrupark حيث ينعكس جمال الطبيعة المحيطة على المنازل.</p>\r\n<div class=\"col-lg-6 col-md-7 col-sm-6 col-xs-12\">\r\n<p class=\"auto-style3\"><strong>مشروعنا يحتوي على 9 أبراج سكنية عصرية متفاوتة الإرتفاعات والإطلالات بشكل رائع ومميز، حيث يحوي على أكثر من ألف شقة سكنية حديثة وعصرية. </strong></p>\r\n<p class=\"auto-style3\"><strong>عمد مصمموا المشروع لإستحداث الأساليب في البناء مراعين أحدث التصاميم والمعايير العالمية الفريدة من نوعها. </strong></p>\r\n<p class=\"auto-style3\"><strong>مشروعنا يغنيك عن الحاجة للذهاب بعيداً للبحث عن حاجياتك بل ستجدها جميعها متوفرة داخل المشروع، حيث </strong>يحتوى المشروع على 89 محل تجارى وقد يتم بناء المشروع على مساحة 42019 م&sup2; كما يحتوى المشروع على مسابح مخصصة للكبار والاطفال ومرافق اجتماعية متكاملة وملاعب سلة وتنس وكرة قدم وغرف ألعاب أطفال ومراكز مخصصة للياقة البدنية وحمامات الساونا والبخار.</p>\r\n</div>\r\n<div class=\"property_data clear_fix col-lg-12 col-md-12 col-sm-12 col-xs-12\">\r\n<p>موقع المشروع يعتبر أقرب المشاريع السكنية من مطار اسطنبول الثالث الجديد الذي سوف يتم افتتاحه العام القادم, وأيضا هو أقرب نقطة من قناة اسطنبول الجديدة ولا ننسى أن المشروع يقع على بعد 2 كيلومتر محطة المترو التي من المخطط افتتاحها في عام 2020 , ويحيط بالمشروع العديد من المرافق المهمة من مستشفيات وجوامع وحدائق خضراء وجامعات كل هذا يجعل من هذا المشروع استثمار مهم جدا وفرصة للعيش في قلب اسطنبول الجديدة.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>الخدمات التي نقدمها للعميل:</strong></p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى إستلام الطابو (وثيقة تسجيل حقوق الملكية).</p>\r\n<p>- نساعدك على تأثيث شقتك.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.</strong><strong>&nbsp;</strong></p>\r\n<p><strong>الهاتف: 00905356865688</strong></p>\r\n<p><strong>البريد الإلكتروني: yahya@alrawi.co</strong></p>\r\n<p><strong>الموقع الإلكتروني:&nbsp;<a href=\"https://alrawi.co/\">alrawi.co</a></strong></p>\r\n<p><strong>الفيس بوك:&nbsp;<a href=\"https://www.facebook.com/AlrawiCom\">facebook.com/AlrawiCom</a></strong></p>\r\n<p><strong>عنوان المكتب: Fatih Halicilar Cad&nbsp; Istanbul, Turkey</strong></p>\r\n<p dir=\"RTL\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>');
