(43, 41, 'ar', 'bizim evler guzelce - مشروع منازلنا الجميلة', 'اسطنبول - بيوك جكمجة - جوزلجة', '<p><span data-contrast=\"auto\">bizim</span><span data-contrast=\"auto\">&nbsp;</span><span data-contrast=\"auto\">evler</span><span data-contrast=\"auto\">&nbsp;</span><span data-contrast=\"auto\">guzelce</span><span data-contrast=\"auto\">&nbsp;- مشروع منازلنا الجميلة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">مشروع&nbsp;</span><span data-contrast=\"auto\">bizim</span><span data-contrast=\"auto\">&nbsp;</span><span data-contrast=\"auto\">evler</span><span data-contrast=\"auto\">&nbsp;</span><span data-contrast=\"auto\">guzelce</span><span data-contrast=\"auto\">&nbsp;عند نقطة&nbsp;</span><span data-contrast=\"auto\">إلتقاء</span><span data-contrast=\"auto\">&nbsp;البحر واليابسة على قمة تلة منطقة \"بيوك&nbsp;شكمجة&nbsp;\" في إحدى أجمل مناطق إسطنبول الساحرة منطقة تجميع&nbsp;</span><span data-contrast=\"auto\">مابين</span><span data-contrast=\"auto\">&nbsp;البحر الساحر&nbsp;</span><span data-contrast=\"auto\">و هدوء</span><span data-contrast=\"auto\">&nbsp;اليابسة والطبيعة التي تحيط اطراف هذا المشروع&nbsp;</span><span data-contrast=\"auto\">مابين</span><span data-contrast=\"auto\">&nbsp;اللون الأزرق والأخضر على بعد رمية حجر لكان وقاطني هذا المجمع&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p style=\"text-align: center;\"><span data-ccp-props=\"{\">هذا المشروع يطابق شروط الحصول على الجنسية التركية&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">نبذة عن المشروع</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يقع المشروع على سواحل منطقة بيوك&nbsp;جكمجة&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">تم تصميم وإنشاء مشروع&nbsp;منازلنا الجميلة&nbsp;بعناية تامة من شركة&nbsp;</span><span data-contrast=\"none\">İhlas</span><span data-contrast=\"none\">&nbsp;</span><span data-contrast=\"none\">Yapı</span><span data-contrast=\"none\">&nbsp;</span><span data-contrast=\"auto\">شركة</span><span data-contrast=\"auto\">&nbsp;المتخصصة في مجال إنشاء المجمعات السكنية&nbsp;</span><span data-contrast=\"auto\">بمايناسب</span><span data-contrast=\"auto\">&nbsp;</span><span data-contrast=\"auto\">إحتياجات</span><span data-contrast=\"auto\">&nbsp;ورفاهية الأشخاص&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يعد هذا المشروع هو ختام سلسلة مشاريع&nbsp;</span><span data-contrast=\"auto\">إنشئتها</span><span data-contrast=\"auto\">&nbsp;هذه الشركة الإنشائية&nbsp;</span><span data-contrast=\"auto\">إنطلاقا</span><span data-contrast=\"auto\">&nbsp;من مشروع&nbsp;bizimevler1 وحتى&nbsp;bizimevler7</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يتميز المشروع بإطلالته على بحر مرمرة مباشرة والقريب من&nbsp;بحيرة&nbsp; بيوك&nbsp;</span><span data-contrast=\"auto\">شكمجة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">&nbsp;تصاميم أنيقة للمطبخ والغرف تتكامل مع الإطلالة الرائعة للمشروع</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">مساحات خضراء واسعة تحيط المشروع داخليا وخارجيا إضافة الى إطلالات ساحرة&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يتكون المشروع من 16 برج&nbsp;سكني ,&nbsp;</span><span data-contrast=\"auto\">بإرتفاعات</span><span data-contrast=\"auto\">&nbsp;متوسطة&nbsp;بخيارات للشقق تبدأ من 1 + 1 إلى 4 + 1 و المشروع يضم 688 وحدة سكنية</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يضم المشروع عدد كبير من الوحدات التجارية المصممة لتكون مقاهي ومطاعم ومراكز تسوق</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">تم تصميم نظام ذكي لإدارة المنزل ومراقبة الباب ومواقف السيارات وحديقة الأطفال</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يتم تسليم المشروع في عام 2020</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">سند الملكية جاهز ويمكنك التملك مباشرة&nbsp;والتقيدم&nbsp;على الجنسية التركية</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">:محيط</span><span data-contrast=\"auto\">&nbsp;المشروع</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يبعد المشروع دقيقة واحدة عن ساحل بحر مرمرة وميناء&nbsp;اليخوت&nbsp;&nbsp;و&nbsp;3 دقائق عن بحيرة&nbsp;</span><span data-contrast=\"auto\">كوتشوك</span><span data-contrast=\"auto\">&nbsp;</span><span data-contrast=\"auto\">شكمجة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يقع مباشرة على&nbsp;الطريق السريع E5 .</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يبعد 40 دقيقة عن المطار الجديد</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">بالإضافة إلى قربه من المطاعم، المشافي، المدارس</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">ميزات المشروع:</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">تصميم معماري وداخلي مميز</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">التشطيب&nbsp;الداخلى&nbsp;للوحدات على اعلى مستوى</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">جميع الشقق لها إطلالة رائعة وشرفة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">مسحات واسعة من الحدائق والممرات المائية داخل المشروع</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">مساحة للنشاطات الترفيهية والاجتماعية</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">مسارات للمشي والرياضة&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">ملاعب داخلية للأطفال تشمل ملاعب كرة سلة وكرة القدم</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">تراس بإطلالة ساحرة على المساحات الخضراء والبحيرة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">ارتفاع الطوابق منخفض</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">مواقف حافلات مباشرة أمام المشروع مباشرة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">تقرير العقارات في منطقة المشروع:</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- وقت&nbsp;</span><span data-contrast=\"auto\">الاسترداد :</span><span data-contrast=\"auto\">&nbsp;23 سنة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- ارتفاع اسعار بيع العقارات خلال 5&nbsp;</span><span data-contrast=\"auto\">سنوات :</span><span data-contrast=\"auto\">&nbsp;78.8٪</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- ارتفاع اسعار تأجير العقارات خلال 5&nbsp;سنوات :&nbsp;62.6٪</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- مجموع سكان&nbsp;المنطقة :&nbsp;</span><strong><span data-contrast=\"auto\">237</span></strong><strong><span data-contrast=\"auto\">.625</span></strong><span data-contrast=\"auto\">&nbsp;نسمة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">-الوضع الاجتماعي&nbsp;الاقتصادي :&nbsp;B - فئة متوسطة مرتفعة&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">-الحالة&nbsp;الاجتماعية :&nbsp;28٪ أعزب / 61٪ متزوج</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">&nbsp;</span></p>\r\n<p>يوجد خصم 25% على الدفع الكاش</p>\r\n<p>كما يوجد تخفيض 25% على أي دفعة أولى&nbsp;</p>\r\n<p>التقسيط يكون على 36 شهر&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><span data-contrast=\"auto\">الخدمات التي نقدمها للعميل:</span></strong><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- نقوم بالإجابة على جميع أسئلتك 24/7.</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- نستقبلك في المطار ونأمن لك إقامة مريحة.</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- نقوم بعمل جولة على العقارات التي تحددها.</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- نساعدك في كل مرحل الشراء حتى&nbsp;إستلام&nbsp;الطابو (وثيقة تسجيل حقوق الملكية).</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- نساعدك على تأثيث شقتك.</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.&nbsp;</span></strong><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">الهاتف: 00905356865688</span></strong><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">البريد الإلكتروني:&nbsp;</span></strong><a href=\"mailto:yahya@alrawi.co\"><strong><span data-contrast=\"none\">yahya@alrawi.co</span></strong></a><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">الموقع الإلكتروني:&nbsp;</span></strong><a href=\"https://alrawi.co/\"><strong><span data-contrast=\"none\">alrawi.co</span></strong></a><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">الفيس بوك:&nbsp;</span></strong><a href=\"https://www.facebook.com/AlrawiCom\"><strong><span data-contrast=\"none\">facebook.com/AlrawiCom</span></strong></a><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">عنوان المكتب:&nbsp;Fatih&nbsp;Halicilar&nbsp;Cad&nbsp;&nbsp;Istanbul,&nbsp;Turkey</span></strong><span data-ccp-props=\"{\">&nbsp;</span></p>'),
(44, 42, 'ar', 'CENTRAL HILL - مشروع التل المركزي', 'اسطنبول - اسنيورت - هراميدرة', '<p>لماذا هذا المجمع ؟</p>\r\n<p>- بإطلالة ساحرة على بحيرة اسطنبول تستيقظ كل صباح في هذا المشروع الساحر لتشاهد اللون الأزرق للمياه من زجاج غرفة نومك&nbsp;</p>\r\n<p>- تستقبل ضيوفك في صالة المنزل لتطل منها على جميل تفصيلات إسطنبول في إحدى اكثر المناطق مركزية&nbsp;</p>\r\n<p>- يعد المشروع احد المشاريع القريبة من المناطق المركزية لاسطنبول كمنطقة بلكدوزو وافجلر ويقع في قلب منطقة اسنيورت&nbsp;</p>\r\n<p>- يبعد المشروع دقيقة واحدة عن الطريق الرئيسي E5 و 3 دقائق عن مول توريم&nbsp;</p>\r\n<p>- يبعد المشروع 3 دقائق فقط عن خط المتروبوص</p>\r\n<p>- يبعد المشروع 35 دقيقة عن مطار اسطنبول الجديد و 25 دقيقة عن المنطقة المركزية لاسطنبول&nbsp;</p>\r\n<p>- يضم المشروع خيارات متنوعة جدا من حيث مساحات الشقق واطلالاتها وعدد الغرف في الشقة \\</p>\r\n<p>- يضم المشروع 3 أبراج بإرتفاعات مختلفة وإطلالات متنوعة&nbsp;</p>\r\n<p>- التدفئة في المشروع تدفئة مركزية لجميع الشقق&nbsp;</p>\r\n<p>- يضم المشروع العديد من الاقسام لخدمة القاطنين فيه من ملاعب ومراكز رياضية وساونا واحواض سباحة&nbsp;</p>\r\n<p>- يضم المشروع سوق خاص فيه يجمع عدد كبير من الماركات العالمية والمحلية&nbsp;</p>\r\n<p>- يحتوي المشروع على نظام امان ذكي لجمي العقارات فيه اضافة الى حراسة على مدار الـ 24 ساعة&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span data-contrast=\"auto\">تقرير العقارات في منطقة المشروع:</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- وقت&nbsp;</span><span data-contrast=\"auto\">الاسترداد :</span><span data-contrast=\"auto\"> 16 سنة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- ارتفاع اسعار بيع العقارات خلال 5&nbsp;</span><span data-contrast=\"auto\">سنوات :</span><span data-contrast=\"auto\"> 93.8٪</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- ارتفاع اسعار تأجير العقارات خلال 5 سنوات :55.2٪</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- مجموع سكان المنطقة : 