(45, 43, 'ar', 'Bahcesehir park - مشروع حدائق بهجة شهير', 'اسطنبول - بشاك شهير - بهجة شهير', '<p>اسطنبول، المدينة الفريدة, من أجمل المدن الكبرى في العالم، وهي نقطة اجتماع الثقافات المختلفة، والتي لها مكانة خاصة في أعين الجميع مع مضيق البوسفور بها وجمالياتها التاريخية وحياة المدينة الحديثة، والتي تجمع بين حداثة الغرب وجمال الشرق، وهي التي استضافت الإمبراطوريات على مرّ العصور.</p>\r\n<p>مشروع Bah&ccedil;eşehir Park &nbsp;&nbsp;لشركة&nbsp; ATMACA Gayrimenkul A.Ş.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>لمحة عن الشركة المالكة والمنفذة..</strong></p>\r\n<p>تعد مجموعة&nbsp; Atmaca Group بشركاتها:</p>\r\n<p>&nbsp;JUMBO لأدوات المطابخ (<a href=\"http://www.jumbo.com.tr\">http://www.jumbo.com.tr</a>)&nbsp; وشركة SUNNY &nbsp;(<a href=\"http://www.sunny.com.tr\">http://www.sunny.com.tr</a>) التي تعد ثالث أكبر شركة منتجة للأدوات الالكترونية والكهربائية في تركيا, كما تقوم بتصدير إنتاجها إلى أكثر من 42 دولة على مستوى العالم.</p>\r\n<p>من الشركات الكبرى على مستوى تركيا, والتي اكتسبت ثقة العملاء على مرّ الزمن.</p>\r\n<p>&nbsp;</p>\r\n<p>من أهم مشاريع الشركة في اسطنبول مشروع Bah&ccedil;eşehir Atmaca في منطقة الــ Bah&ccedil;eşehir وهو مشروع متنوع بين فيلات وأبنية ذات عدد طوابق منخفض, يتكون من 31 بناء تحوي 225 شقة سكنية, هذا المشروع في مركز منطقة الــ Bah&ccedil;eşehir وهو مخدّم بالنوادي الرياضية والترفيهية والمساحات الخضراء.</p>\r\n<p>&nbsp;</p>\r\n<p>أما أحدث مشاريع الشركة فهو مشروع <strong>Bah&ccedil;eşehirPark</strong> وهو مشروع متنوع يحوي يحوي شقق ووحدات سكنية, مجمع تجاري, بالإضافة إلى حديقة كبيرة تحوي سوق تجاري مفتوح...</p>\r\n<p>&nbsp;</p>\r\n<p>يقع المشروع في منطقة الـ Bah&ccedil;eşehir وهي من المناطق ذات التطور العقاري الحديث في مدينة اسطنبول, تقع بالقسم الأروبي, وهي على مسافة 12 كم &nbsp;غرباً من مشروع Mall Of Istanbul, كما أنها تبعد عن مطار اسطنبول الجديد بحدود 25 كم, وعن مراكز المدينة (تقسيم) بحدود 35 كم, تقع على جانب الطريق السريع E80, وهي بالقرب من الطريق السريع الجديد الذي يصل جسرالسلطان ياووظ سليم (الجسر الثالث على البوسفور) مع المطار الجديد, كما أنها على مسافة 18 كم من مطار أتاتورك, وبذلك فهي ذات موقع متميز بعيد نسبياً من ازدحام المدينة وصخبها, ولكنها بوجود شبكة الطرق الرئيسية التي تحدها تعدّ قريبة إلى مراكز اسطنبول السياحية.</p>\r\n<p>&nbsp;</p>\r\n<p>المواصلات من وإلى منطقة الـ Bah&ccedil;eşehir</p>\r\n<ul>\r\n<li>خط القطار الذي يصل بين منطقة الـ Bah&ccedil;eşehir والـ Sirkeci&nbsp; ليتصل بذلك مع محططة مترو مرمراي.</li>\r\n<li>خط مترو يصل بين منطقة الـ Bah&ccedil;eşehir والـ Mecidiyek&ouml;y , وهذا الخط تمّ المباشرة بأعماله وسيتم الانتهاء منه في منتصف سنة 2021 بحسب تصريحات البلدية.</li>\r\n<li>باصات الاكسبريس من وإلى المراكز الرئيسية كمنطقة تقسيم &ndash; مجيدية كوي &ndash; باكركوي.... وهي رحلات منتظمة ومباشرة دون التوقف في الطريق على مدى 18 ساعة في اليوم.</li>\r\n</ul>\r\n<p>وأخيراً, فإن منطقة الـ Bah&ccedil;eşehir من المناطق ذات المساحة الخضراء والحدائق الأكبر على مستوى اسطنبول, كما تعد من المناطق الحديثة أو التي تم استحداثها في السنوات الثلاثين الأخيرة, وقد شهدت تطوراً عمرانيا يتصف بالحداثة وجمالية التصميم وحسن التنظيم العمراني وتنوع الخدمات وتوافرها, مما أدى إلى كون سكانها من القسم المثقّف والراقي بغالبيته, وملاءمتها للحياة العائلية بشكل خاص.</p>\r\n<p><strong>مشروع </strong><strong>Bah&ccedil;eşehirPark</strong></p>\r\n<p>مساحة الأرض 20,434 م<sup>2</sup> وتم بناء ثلاث أبنية سكنية عليها:</p>\r\n<ul>\r\n<li>البناء <strong>A</strong> : ويتكون من 18 طابق, الطابقين الأول والثاني تحوي شقق سكنية من النمط غرفة وصالة, غرفتين وصالة وثلاث غرف وصالة. الطوابق الأعلى تحوي شقق كلها أربع غرف وصالة, كل طابق يحوي أربع شقق سكنية 4+1 بمساحات متساوية 192م<sup>2 </sup>صافي, وفي الطابقين الأخيرين يوجد أربع شقق Penthouse كل منها 5+1 .</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>البناء <strong>B</strong> : ويتكون من 17 طابق, الطابقين الأول والثاني تحوي شقق سكنية من النمط غرفة وصالة, غرفتين وصالة وثلاث غرف وصالة. الطوابق الأعلى تحوي شقق كلها أربع غرف وصالة, كل طابق يحوي أربع شقق سكنية 4+1 بمساحات متساوية 192م<sup>2 </sup>صافي, وفي الطابقين الأخيرين يوجد أربع شقق Penthouse كل منها 5+1 .</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>البناء <strong>C</strong> : ويتكون من 5 طوابق, الطوابق الأربعة تحوي شقق سكنية من النمط غرفة وصالة وثلاث غرف وصالة. الطابق الخامس يحوي مسبح مفتوح للكبار, مسبح للأطفال, صالة رياضة وكافتريا.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>تحت الشقق السكنية وفي الساحة الرئيسية كلها محلات تجارية تشكل السوق التجاري للمشروع, كما يوجد تحت الأبنية خمسة طوابق تحت الارض, الطابق الأول: محلات تجارية, الطابق الثاني: سوبر ماركت كبير, تكنولوجي ماركت كبير, 8 صالات سينما و مساحة خاصة لـ <strong>KidZania</strong> &nbsp;.</p>\r\n<p>الطوابق الثلاث الأخرى تحت الأرض مخصصة لمواقف السيارات للسكّان والزائرين.</p>\r\n<p>خلف المجمع توجد الحديقة العامة Bah&ccedil;eşehir G&ouml;let Park التي يتم إعادة هيكلتها وتنظيمها من طرف الشركة, وتمّ إنشاء سوق تجاري مفتوح (Bah&ccedil;eşehir Cadde) يحوي 122 محلاً تجارياً بمساحات مختلفة (150 م<sup>2</sup> &ndash; 550 م<sup>2</sup>) حدائق ألعاب للأطفال, منطقة خاصة لتعليم الأطفال قواعد المرور (سيارات صغيرة تعمل على البطارية), مسرح الهواء الطلق, حديقة المغامرين وهي حديقة تحوي ألعاب خاصة باليافعين والشباب والمغامرة. كما تحوي الحديقة على البحيرة الاصطناعية الأكبر في اسطنبول, والكثير من المساحات الخضراء الخاصة بالتنزّه وممارسة الرياضة في الهواء الطلق والكثير الكثير من الفعاليات الأخرى.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>مواصفات المشروع:</strong></p>\r\n<p><strong>البناءين&nbsp;&nbsp;&nbsp; </strong><strong>&nbsp;A</strong><strong> , </strong><strong>B</strong><strong>&nbsp; :</strong></p>\r\n<p>كل بناء يتألف من 17-18 طابق.</p>\r\n<p>يوجد في كل طابق 4 شقق.</p>\r\n<p>جميع الشقق 4 غرف وصالون.</p>\r\n<p>مجموع الشقق الإجمالي 99&nbsp; شقة 4+1, 8 شقق 5+1 &nbsp;و 118 &nbsp;شقة منوعة (1+1 2+1 3+1).</p>\r\n<p>المساحة الصافية للشقة 4+1: 191 م<sup>2</sup></p>\r\n<p>كل شقة 4+1 تحوي بلكون مساحته 12م<sup>2</sup></p>\r\n<p>كل شقة 4+1 تحوي حمام لغرفة النوم الرئيسية, حمام مشترك, وحمام للضيوف.</p>\r\n<p>كل شقة تحوي نظام تكييف مركزي مستقل, وهو موزع على جميع الغرف والصالون بشكل منفصل, أما بخصوص التدفئة فهي عن طريق التمديدات تحت الأرض, أو عن طريق التكييف.</p>\r\n<p><strong>المحلات التجارية:</strong></p>\r\n<p>يحوي المجمع على 75 محل تجاري تحت الشقق السكنية, بالإضافة إلى المحلات التجارية المغلقة تحت الأرض التي تحوي السوبر ماركت, وماركت الالكترونيات والتكنولوجيا و مساحة خاصة بـ KidZania بالإضافة إلى 8 صالات سينما.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>الحديقة والسوق التجاري بها:</strong></p>\r\n<p>خلف الأبنية توجد الحديقة العامة لمنطقة الباهشة شهير, وقد قامت شركة ATMACA Gayrimenkul A.Ş بتوقيع عقد مع بلدية منطقة الباهشة شهير لإعادة هيكلة هذه الحديقة وبناء سوق ومحلات تجارية على نمط السوق المفتوح, يحوي على 122 محل تجاري بمساحات مختلفة تتراوح بين 150 م<sup>2</sup> إلى 550 م<sup>2</sup> , وهذه المحلات أيضا معروضة للبيع, وهي تعدّ من الفرص ذات العائد التأجيري والاستثماري المرتفع نسبيا بما يعادل 7.5% سنويا.</p>\r\n<p>وبذلك يعد مشروع الــ <strong>Bah&ccedil;eşehirPark</strong><strong>&nbsp; </strong>من المشاريع المميزة القليلة في اسطنبول بسبب كونه مشروع سكني, تجاري, ترفيهي, ذو قيمة وعائد استثماري مجدي.</p>\r\n<p>&nbsp;</p>'),
(46, 44, 'ar', 'KELES CENTER - مشروع مركز كيلش', 'Küçükçekmece - İstanbul', '<p>مشروع مركز كيليش احد اندر المشاريع التي تجمع العديد من المزايا الاستثمارية فيها حيث يقع هذا المشروع في احدى اهم النقاط الرئيسية في اسطنبول ويطل اطلالة مباشرة على مطار اتاتورك - مطار اسطنبول الرئيسي السابق و مركز المعارض الرئيسي حاليا ويجاور خطين رئيسيين من خطوط المواصلات في اسطنبول وهما خط الإكسبرس الاستثمار والذي تشجع بلدية اسطنبول على البناء والاستثمار فيه وخط الـ E5 الذي يربط شطري اسطنبول ببعضهما&nbsp;</p>\r\n<p>- تتركز أهمية المشروع ايضا في انه يقع في نظاق المناطق التي تسعى بلدية اسطنبول الى تحويلها الى مناطق جذب تجاري اي ان المحيط الاسكاني للمشروع تم تحويله بالكامل الى منطقة استثمارية تبادر كبرى الشركات للاستثمار فيها وانشاء ارقا المشاريع السكنية والتجارية فيه والتي تقدم اعلى الخدمات فيها&nbsp;</p>\r\n<p>- يضاف الى ذالك قرب المشروع من مركز التجارة الخاص بمدينة اسطنبول والذي يعد الشريان التجاري والمالي للمدينة&nbsp;</p>\r\n<p>- يقع المشروع مباشرة على الخطين الرئيسيين لمدينة اسطنبول مايعني تخلص القاطنين فيه من احدى اكبر المشاكل في المدينة الا وهية مشكلة الازدحام المروري للقاطنين في مناطق بعيدة عن الخطوط الرئيسية&nbsp;</p>\r\n<p>- تتميز منطقة المشروع بوجود عدد كبير من المولات والمراكز التجارية فيه كما ان خط \" الباسن إكسبرس \" الذي يقع عليه المشروع يؤدي مباشرة الى أهم مول في مدينة إسطنبول \" مول أوف اسطنبول \"&nbsp;</p>\r\n<p>- يوافق المشروع شروط و خيارات الجنسية التركية&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>نبذة عن المشروع :</p>\r\n<p>يقع المشروع في منطقة البحيرة الصغيرة أو \" K&uuml;&ccedil;&uuml;k&ccedil;ekmece \"</p>\r\n<p>تم إنشاء المشروع من قبل شركة &nbsp;keleş inşaat الشركة المتخصصة في إنشاء المشاريع الاستثمارية&nbsp;</p>\r\n<p>يتميز المشروع بإطلالته على بحر مرمرة و بحيرة \" K&uuml;&ccedil;&uuml;k&ccedil;ekmece \"&nbsp; أو البحيرة الصغيرة والتي تطمح الحكومة التركية لشق قناة اسطنبول الثانية عن طريقها في المستقبل&nbsp;</p>\r\n<p>&nbsp;تصاميم أنيقة للمطبخ والغرف تتكامل مع الإطلالة الرائعة للمشروع&nbsp;</p>\r\n<p>مساحات خضراء واسعة تحيط المشروع داخليا وخارجيا إضافة الى إطلالات ساحرة&nbsp;&nbsp;</p>\r\n<p>يتكون المشروع من 3 أبراج , بإرتفاعات متوسطة بخيارات للشقق&nbsp; 1 + 1 - 2 + 1 ويضم المشروع 498 وحدة عقارية&nbsp;</p>\r\n<p>يضم المشروع عدد كبير من الوحدات التجارية المصممة لتكون مقاهي ومطاعم ومراكز تسوق&nbsp;</p>\r\n<p>تم تصميم نظام ذكي لإدارة المنزل ومراقبة الباب ومواقف السيارات وحديقة الأطفال بما يوفر الامان والراحة الكاملة للقاطنين فيه&nbsp;</p>\r\n<p>يتم تسليم المشروع في عام 2020&nbsp;</p>\r\n<p>سند الملكية جاهز ويمكنك التملك مباشرة&nbsp;والتقيدم&nbsp;على الجنسية التركية&nbsp;</p>\r\n<p>&nbsp;&nbsp;</p>\r\n<p>:محيط&nbsp;المشروع&nbsp;</p>\r\n<p>يبعد المشروع 4 دقائق عن ساحل بحر مرمرة وميناء اليخوت&nbsp;&nbsp;و 3 دقائق عن بحيرة \" K&uuml;&ccedil;&uuml;k&ccedil;ekmece \" او البحيرة الصغيرة&nbsp;</p>\r\n<p>يقع مباشرة على&nbsp;الطريق السريع E5 . وطريقة الباسن إكسبرس 0-7&nbsp;</p>\r\n<p>يبعد 40 دقيقة عن المطار الجديد و يقع مباشرة على مطار اتاتورك&nbsp;</p>\r\n<p>بالإضافة إلى قربه من المطاعم، المشافي، المدارس&nbsp;</p>\r\n<p>&nbsp;&nbsp;</p>\r\n<p>ميزات المشروع:&nbsp;</p>\r\n<p>تصميم معماري وداخلي مميز&nbsp;</p>\r\n<p>التشطيب&nbsp;الداخلى&nbsp;للوحدات على اعلى مستوى&nbsp;</p>\r\n<p>جميع الشقق لها إطلالة رائعة وشرفة&nbsp;</p>\r\n<p>مسحات واسعة من الحدائق والممرات المائية داخل المشروع&nbsp;</p>\r\n<p>مساحة للنشاطات الترفيهية والاجتماعية&nbsp;</p>\r\n<p>مسارات للمشي والرياضة&nbsp;&nbsp;</p>\r\n<p>اطلالة مباشرة على مطار اسطنبول السابق&nbsp;</p>\r\n<p>موقع المشروع المميز على شارعين رئيسيين من شوارع اسطنبول&nbsp;</p>\r\n<p>ملاعب داخلية للأطفال تشمل ملاعب كرة سلة وكرة القدم&nbsp;</p>\r\n<p>تراس بإطلالة ساحرة على المساحات الخضراء والبحيرة&nbsp;</p>\r\n<p>ارتفاع الطوابق منخفض&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>تقرير العقارات في منطقة المشروع:&nbsp;</p>\r\n<p>- وقت&nbsp;الاسترداد : 17 سنة&nbsp;</p>\r\n<p>- ارتفاع اسعار بيع العقارات خلال 5&nbsp;سنوات : 141.08٪&nbsp;</p>\r\n<p>- ارتفاع اسعار تأجير العقارات خلال 5 سنوات : 89٪&nbsp;</p>\r\n<p>- مجموع سكان المنطقة : 770.317&nbsp;نسمة&nbsp;</p>\r\n<p>-الوضع الاجتماعي الاقتصادي : A+ - فئة مرتفعة جدا ( الدخل - التعليم )&nbsp;</p>\r\n<p>-الحالة الاجتماعية : 24٪ أعزب / 62٪ متزوج&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>الخدمات التي نقدمها للعميل:&nbsp;</p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.&nbsp;</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.&nbsp;</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.&nbsp;</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى&nbsp;إستلام&nbsp;الطابو (وثيقة تسجيل حقوق الملكية).&nbsp;</p>\r\n<p>- نساعدك على تأثيث شقتك.&nbsp;</p>\r\n<p>&nbsp;&nbsp;</p>\r\n<p>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.&nbsp;&nbsp;</p>\r\n<p>الهاتف: 00905356865688&nbsp;</p>\r\n<p>البريد الإلكتروني:&nbsp;<a href=\"mailto:yahya@alrawi.co\">yahya@alrawi.co</a>&nbsp;</p>'),
(47, 45, 'ar', 'SEMT BAHÇEKENT - سمت بهجة كنت', 'اسطنبول - باشاك شهير - بهجة شهير', '<p>مشروع \" سمت بهجة كنت \" يقع في إحدى أحدء المناطق في مدينة إسطنبول في من \" بهجة شهير \" حيث تتميز المنطقة بإتساع الغابات فيها والمساحات الخضراء إضافة الى تميز المنطقة بجو مخالف لباقي مناطق اسطنبول الساحلية لوجودها على مرتفع حيث تتميز المنطقة بجو بارد صيفا مقارنة بالمناطق الاخرى من اسطنبول</p>\r\n<p>كما تتمزي المنطقة بأنها إحدى اهدأ المناطق في اسطنبول على الرغم من قربها من المناطق المركزية حيث تبعد المنطقة 25 دقيقة فقط عن منطقة تقسيم - مع ذالك تتميز المنطقة بهدوء المناطق الريفية كمنطقة شيلة التي تبعد ساعتين واكثر</p>\r\n<p>&nbsp;</p>\r\n<p>- يتمتع الساكن في مشروع \" سمت بهجة كنت \" بهدوئ وطمأنينة الساكن في المناطق الريفية اضافة الى قربه من المناطق المركزية والتجارية لاسطنبول&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><span data-ccp-props=\"{\">هذا المشروع يطابق شروط الحصول على الجنسية التركية&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">نبذة عن المشروع</span><span data-ccp-props=\"{\"> :</span></p>\r\n<p><span data-contrast=\"auto\">يقع المشروع في منطقة بهجة شهير&nbsp;</span></p>\r\n<p>تم إنشاء المشروع بإشراف الحكومة التركية وضمانها وإشراف أكبر شركتين للإنشائات في تركيا شركة \" emlakkonut \" وشركة \" toki \"</p>\r\n<p><span data-contrast=\"auto\">يتميز المشروع بوقوعه في منطقة تجمع النمط والجو الرفيفي بالاضافة الى النطاق العمراني الراقي&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">&nbsp;تصاميم أنيقة للمطبخ والغرف تتكامل مع الإطلالة الرائعة للمشروع</span><span data-ccp-props=\"{\"> على المساحات الخضراء&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">مساحات خضراء واسعة تحيط المشروع داخليا وخارجيا&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يتكون المشروع من 6 أبراج سكنتية, </span><span data-contrast=\"auto\">بإرتفاعات</span><span data-contrast=\"auto\"> من متوسطة الى مرتفعة&nbsp; بخيارات للشقق تبدأ من 1 + 1 إلى 4 + 1 و المشروع يضم 669 وحدة سكنية</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يضم المشروع عدد كبير من الوحدات التجارية المصممة لتكون مقاهي ومطاعم ومراكز تسوق</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">تم تصميم نظام ذكي لإدارة المنزل ومراقبة الباب ومواقف السيارات وحديقة الأطفال</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يتم تسليم المشروع في عام 2020</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-ccp-props=\"{\">سيتميز المشروع بوجود عدد كبير من الخدمات التي ستقدم للقاطنين فيه من المراكز الرياضية والساونا والمسابح المغلقة والمفتوحة والملاعب&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">سند الملكية جاهز ويمكنك التملك مباشرة&nbsp;والتقيدم&nbsp;على الجنسية التركية</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">:محيط</span><span data-contrast=\"auto\">&nbsp;المشروع</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يبعد المشروع 25 دقيقة عن منطقة تقسيم و 20 دقيقة عن مطار اتاتورك و 30 دقيقة عن مطار اسطنبول الجديد&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">يقع مباشرة على الطريق السريع E80 .</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">ميزات المشروع:</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">تصميم معماري وداخلي جيد</span></p>\r\n<p><span data-contrast=\"auto\">التشطيب الداخلى للوحدات جيد</span></p>\r\n<p><span data-contrast=\"auto\">جميع الشقق لها إطلالة على الطبيعة وشرفة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">مسحات واسعة من الحدائق والممرات المائية داخل المشروع</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">مساحة للنشاطات الترفيهية والاجتماعية</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">مسارات للمشي والرياضة&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">ملاعب داخلية للأطفال تشمل ملاعب كرة سلة وكرة القدم</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">تراس بإطلالة ساحرة على المساحات الخضراء والبحيرة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">مواقف حافلات مباشرة أمام المشروع مباشرة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-ccp-props=\"{\">يتوقع إفتتاح محطة قطار في عام 2020 في المنطقة التابع لها المشروع&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">تقرير العقارات في منطقة المشروع:</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- وقت&nbsp;</span><span data-contrast=\"auto\">الاسترداد :</span><span data-contrast=\"auto\">&nbsp;23 سنة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- ارتفاع اسعار بيع العقارات خلال 5&nbsp;</span><span data-contrast=\"auto\">سنوات :</span><span data-contrast=\"auto\">&nbsp;78.8٪</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- ارتفاع اسعار تأجير العقارات خلال 5&nbsp;سنوات :&nbsp;62.6٪</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- مجموع سكان المنطقة : <strong>427.835 </strong></span><span data-contrast=\"auto\">نسمة</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">-الوضع الاجتماعي الاقتصادي : <strong>A-&nbsp;</strong> فئة متوسطة مرتفعة جدا</span></p>\r\n<p><span data-contrast=\"auto\">-الحالة الاجتماعية : 28٪ أعزب / 65٪ متزوج</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">الخدمات التي نقدمها للعميل:</span></strong><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- نقوم بالإجابة على جميع أسئلتك 24/7.</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- نستقبلك في المطار ونأمن لك إقامة مريحة.</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- نقوم بعمل جولة على العقارات التي تحددها.</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- نساعدك في كل مرحل الشراء حتى&nbsp;إستلام&nbsp;الطابو (وثيقة تسجيل حقوق الملكية).</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">- نساعدك على تأثيث شقتك.</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span data-contrast=\"auto\">&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.&nbsp;</span></strong><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">الهاتف: 00905356865688</span></strong><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">البريد الإلكتروني:&nbsp;</span></strong><a href=\"mailto:yahya@alrawi.co\"><strong><span data-contrast=\"none\">yahya@alrawi.co</span></strong></a><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">الموقع الإلكتروني:&nbsp;</span></strong><a href=\"https://alrawi.co/\"><strong><span data-contrast=\"none\">alrawi.co</span></strong></a><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">الفيس بوك:&nbsp;</span></strong><a href=\"https://www.facebook.com/AlrawiCom\"><strong><span data-contrast=\"none\">facebook.com/AlrawiCom</span></strong></a><span data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">عنوان المكتب:&nbsp;Fatih&nbsp;Halicilar&nbsp;Cad&nbsp;&nbsp;Istanbul,&nbsp;Turkey</span></strong><span data-ccp-props=\"{\">&nbsp;</span></p>'),
