(51, 49, 'ar', 'TEMA İSTANBUL - تيما اسطنبول', 'Küçükçekmece/İstanbul', '<p>أحد أضخم المشاريع السكنية والاستثمارية في مدينة اسطنبول بتعداد وحدات عقارية يتجاوز الـ 3500 وحدة من شقق ومعارض و محلات تجارية&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>الخدمات التي نقدمها للعميل:&nbsp;</p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.&nbsp;</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.&nbsp;</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.&nbsp;</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى&nbsp;إستلام&nbsp;الطابو (وثيقة تسجيل حقوق الملكية).&nbsp;</p>\r\n<p>- نساعدك على تأثيث شقتك.&nbsp;</p>\r\n<p>&nbsp;&nbsp;</p>\r\n<p>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.&nbsp;&nbsp;</p>\r\n<p>الهاتف: 00905356865688&nbsp;</p>\r\n<p>البريد الإلكتروني:&nbsp;<a href=\"mailto:yahya@alrawi.co\">yahya@alrawi.co</a>&nbsp;</p>'),
(52, 50, 'ar', 'VADİSTANBUL - مشروع وادي اسطنبول', 'اسطنبول - مسلك ', '<p>يقع مشروع <a href=\"https://www.thehouseturkey.com/projects/vadistanbul/\" target=\"_blank\" rel=\"noopener\">Vadistanbul</a> في أكثر المناطق رقياً في اسطنبول (منطقة مسلك الشهيرة) في الطرف الأوربي، ويعتبر واحد من أكبر المشاريع في اسطنبول، يضم في نطاقه الخاص مركز تجاري هو الأكبر في المنطقة، ومكاتب، وفندق، وشوارع تسوق.</p>\r\n<p>كما يوفر لكم إطلالة رائعة على المدينة وعلى غابات بلغراد المشهورة وعلى نهر Sadabad ، وكما يمكنك الوصول لأي مكان في المدينة بالموصالات العامة بكل سهولة، حيث يتوفر مترو هوائي معلق في داخل المشروع، وهو الأول من نوعة في تركيا (خط مترو خاص) تم إنشاؤه حصريًا للمشروع والذي سيربط Seyrantepe Metro Station and Vadistanbul Bulvar ، حيث يهدف ذلك الى ربط المشروع بالأماكن الرئيسية و المهمة في المدينة.</p>\r\n<p>يوجد مركز تسوق فريد من نوعه مساحته 103.000 متر مربع في شارع&nbsp;<strong>Vadistanbul &nbsp;Boulevard</strong>&nbsp;وذلك بفضل التصميم غير المسبوق الذي يلفت انتباهك للوهلة الأولى ، حيث يعد مركز التسوق في&nbsp;<a href=\"https://www.thehouseturkey.com/projects/vadistanbul/\" target=\"_blank\" rel=\"noopener\">Vadistanbul Boulevard</a>&nbsp;العنوان الجديد للأزياء والترفيه والثقافة والفن في اسطنبول بتوفر المئات من المتاجر والعلامات التجارية الرائدة في العالم.</p>\r\n<p>وكما أقيم أكبر مجمع مكاتب في تركيا في شارع Vadistanbul. يجمع <strong>Vadistanbul Boluevard</strong>&nbsp;&ldquo;عالم الأعمال&rdquo; في اسطنبول في ما مجموعه مكونة من 9 أبنية بمساحة إجمالية تبلغ 180.000 متر مربع من المساحات المكتبية.</p>\r\n<p>وكما يمتاز المشروع بهوائه النقي النظيف حيث يجاور المشروع مساحات شاسعة مفتوحة من الغابات \"<strong>غابات بلغراد</strong>\"، والتي تمتدّ ابتداءً من محاذاة الوادي ولا تنتهي حتى شواطئ البحر الأسود.</p>\r\n<ul>\r\n<li>وكما يقع مشروع<strong> <a href=\"https://www.thehouseturkey.com/projects/vadistanbul/\" target=\"_blank\" rel=\"noopener\">Vadistanbul </a> </strong>على مسافة قريبة من أكثر المناطق حيويّةً في إسطنبول مثل تقسيم وليفينت ومسلك، ما يكسبه أهميّة استراتيجيّة واستثماريّة عالية.</li>\r\n<li>ويبعد عن الطريق الرئيسي في اسطنبول TEM مسافة 5 دقائق</li>\r\n<li>وعن المطار الجديد (مطار اسطنبول) 25 دقيقة</li>\r\n<li>وعن محطة المترو 5 دقائق</li>\r\n<li>وعن مضيق البوسفور 5 دقائق&nbsp;</li>\r\n<li>وعن غابات بلغراد 5 دقائق&nbsp;</li>\r\n<li>مجاور كذلك لملعب تورك تليكوم أرينا</li>\r\n<li>&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>الخدمات التي نقدمها للعميل:&nbsp;</p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.&nbsp;</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.&nbsp;</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.&nbsp;</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى&nbsp;إستلام&nbsp;الطابو (وثيقة تسجيل حقوق الملكية).&nbsp;</p>\r\n<p>- نساعدك على تأثيث شقتك.&nbsp;</p>\r\n<p>&nbsp;&nbsp;</p>\r\n<p>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.&nbsp;&nbsp;</p>\r\n<p>الهاتف: 00905356865688&nbsp;</p>\r\n<p>البريد الإلكتروني:&nbsp;<a href=\"mailto:yahya@alrawi.co\">yahya@alrawi.co</a>&nbsp;</p>'),
(53, 51, 'ar', 'Başakkent Gölet - مشروع باشاك كنت ', 'Başakşehir / İstanbul', '<p>ميزات مشروع Başakkent</p>\r\n<p>يجري تنفيذ مشروع Başakkent G&ouml;let في منطقة باشاك شهير في اسطنبول بالتعاون بين شركة كيبتاش وبلدية باشاك شهير.</p>\r\n<p>تم تصميم مشروع Başakkent Pond ، الذي يتكون من 14 مبنى ، ليكون لديه مفهوم عائلي كامل.</p>\r\n<p>أسعار المنازل في المشروع مناسبة جداً وتعد من أفضل الأسعار في المنطقة</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>يمتد المشروع على مساحة 55 ألف متر مربع في حي بهجة شهير التابع لبلدية باشاك شهير وهناك 894 منزل في المشروع.</p>\r\n<p>مساحات المنازل في المشروع هي كالتالي:</p>\r\n<p>2 + 1 بين 82 متر مربع و 106 متر مربع</p>\r\n<p>3 + 1 الشقق 136 متر مربع</p>\r\n<p>&nbsp;4 + 1 الشقق 171 متر مربع</p>\r\n<p>منطقة المشروع تعد واحدة من المناطق السكنية المتصاعدة بسرعة في اسطنبول. بفضل ميزة الموقع الذي يوفر سهولة الوصول إلى الطرق الرئيسية إلى جانب العديد من المؤسسات التعليمية والصحية.</p>\r\n<p>&nbsp;</p>\r\n<p>في مشروع Başakkent G&ouml;let ، تتوفر جميع المرافق الاجتماعية لتعيش حياة مريحة وممتعة. تشمل المرافق الاجتماعية المدرجة في المشروع غرفة للياقة البدنية، ومنطقة رياضية متعددة الأغراض، وساحة مع حوض سباحة، وموقف سيارات خارجي، والأمن 24 ساعة، و3 ملاعب مختلفة للأطفال، ومناظر طبيعية خاصة.</p>\r\n<p>&nbsp;</p>\r\n<p>تاريخ التسليم:</p>\r\n<p>سندات الملكية جاهزة ويمكن التملك مباشرة</p>\r\n<p>من المقرر الانتهاء منه وتسليمه في يوليو من عام 2020.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>الخدمات التي نقدمها للعميل:&nbsp;</p>\r\n<p>- نقوم بالإجابة على جميع أسئلتك 24/7.&nbsp;</p>\r\n<p>- نستقبلك في المطار ونأمن لك إقامة مريحة.&nbsp;</p>\r\n<p>- نقوم بعمل جولة على العقارات التي تحددها.&nbsp;</p>\r\n<p>- نساعدك في كل مرحل الشراء حتى&nbsp;إستلام&nbsp;الطابو (وثيقة تسجيل حقوق الملكية).&nbsp;</p>\r\n<p>- نساعدك على تأثيث شقتك.&nbsp;</p>\r\n<p>&nbsp;&nbsp;</p>\r\n<p>في حال وجود أي أسئلة أو ملاحظات يرجى عدم التردد بالاتصال بنا.&nbsp;&nbsp;</p>\r\n<p>الهاتف: 00905356865688&nbsp;</p>\r\n<p>البريد الإلكتروني:&nbsp;<a href=\"mailto:yahya@alrawi.co\">yahya@alrawi.co</a>&nbsp;</p>');
