(7, 6, 'ar', 'فرصة عقارية في مدينة يلوا التركية', 'تركيا - يلوا', '<p>فرصة عقارية في مدينة يلوا التركية<br />فيلا مكونة من 3 طوابق + بدروم<br />المدخل: صالون + مطبخ + حمام<br />الطابق الأول: غرفتين نوم + حمامات<br />الطابق الثاني: غرفة + مطبخ + بلكون (ترس)<br />البدروم: مخزن<br />مساحة كل طابق: 80 م2</p>\r\n<p>المجمع مكون من 7 فلل بجانب بعضها البعض على مساحة 1740 م2</p>\r\n<p>للاستفسارات يرجى التواصل معنا:<br />+905356865688</p>'),
(8, 7, 'ar', 'شقة جديدة 1+1 A طابق أرضي شرقي', 'تركيا - إسطنبول - بيليك دوزو', '<p><span style=\"font-size: 18pt;\">تقع&nbsp; الشقة في واحدة من أرقى مناطق اسطنبول \"بيليك دوزو\"، مباشرة على شاطئ بحر مرمرة الساحر، المنطقة ذات الأهمية في العقارات بسبب قربها من الطريق السريع \"E5\" الذي يٌعتبر الشريان الذي يربط إسطنبول، والذي سيتحول إلى خط ميترو أنفاق خلال عامين.</span></p>\r\n<p><span style=\"font-size: 18pt;\">تقع على بعد دقائق فقط من محطة الباصات التي تصل إلى الطريق السريع \"E5\".</span></p>\r\n<p><span style=\"font-size: 18pt;\">تتوسط العديد والمراكز الصحية والتعليمية ومراكز التسوق والمكاتب.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 18pt;\">المسافة إلى:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 600;\"><span style=\"font-size: 18pt;\">مطار أتاتورك: 12 كم</span></li>\r\n<li style=\"font-weight: 600;\"><span style=\"font-size: 18pt;\">المطار الثالث: 32 كم</span></li>\r\n<li style=\"font-weight: 600;\"><span style=\"font-size: 18pt;\">مركز المدينة: 25 كم</span></li>\r\n<li style=\"font-weight: 600;\"><span style=\"font-size: 18pt;\">الشاطئ: 2 كم</span></li>\r\n</ul>'),
